INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (115, 4, 5, 579978, '2024-05-21 13:37:14.817365', '2024-05-21 13:37:19.682858', 'db9f29ba-90d6-4557-89a5-2834700c4fec', 'Просторная квартира в Лебяжем. Материал стен: каркасно-блочный. Год постройки: 2014. Этаж: 5/7, лоджия застеклена Площадь по СНБ 115 Общая площадь: 112.3. Жилая площадь: 85.2. Площадь кухни: 1. Высота потолка: 2.74. Квартира без отделки. Рядом природный водоём - водохранилище "Дрозды", единственный в черте города природоохранный заповедник - озеро «Лебяжее», парковая зона элитного жилого района «Дрозды» и второй по величине в Беларуси искусственный водоём – Заславское водохранилище (Минское море). В районе расположения дома и прилегающих отсутствуют промышленные производства. Развитая инфраструктура района, здесь есть всё необходимое для комфортной жизни. Рядом с домом многочисленные объекты инфраструктуры: торговые, медицинские и развлекательные центры, спортивные комплексы, фитнес – клубы, центр йоги, спа – салоны, салоны красоты, парикмахерские, места общественного питания, детский сад, школа, частная школа, зелёные зоны отдыха, торгово-развлекательные центры, Минск-Арена, Арена-сити и многое другое. Хорошее транспортное сообщение, рядом с домом остановка общественного транспорта. Удобный выезд на МКАД, что обеспечивает комфортный доступ в любой район Минска и пригорода. Прямая продажа.', 'SALE', '/sale-flats/object/3314068/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (47, 1, 11, 290, '2024-05-21 13:37:14.828642', '2024-05-21 13:37:24.780691', 'a2af2896-2dc8-4bdb-91be-46e3931848c4', 'По-настоящему роскошные Апартаменты находящиеся в одном из элитных комплексов города Минска . Замечательный вид из окон на реку Свислочь и Старый город придает еще большее чувство комфорта. 1-комнатные апартаменты гостиничного типа посуточно в элитном доме "У Троицкого", Ваш правильный выбор. К вашим услугам шикарные апартаменты, оснащенные всей необходимой для комфортного проживания бытовой техникой. В 200 метрах находится охраняемая платная парковка, где можно оставить машину. Любителям вкусно покушать предлагаем посетить рестораны европейской, японской и национальной белорусской кухни в историческом комплексе «Троицкое предместье» и «Раковское предместье», расположенные в шаговой доступности. Бронирование, весь пакет документов, гибкая система скидок, уборка производится по санитарным нормам гостиниц. При аренде от 10 суток и более цена договорная.', 'RENT_FOR_DAY', '/rent-flat-for-day/object/2167437/');
