INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (68, 1, 14, 238937, '2024-05-21 14:42:11.573267', '2024-05-21 14:42:11.60513', '56d6489b-dc65-450c-95f3-debe6f802ad0', 'Бизнес-апартаменты со свободной планировкой по самой выгодной цене в ЖК Минск Мир. Работаем по партнерской программе напрямую с застройщиком без каких-либо комиссий и переплат. Долевое строительство. Срок сдачи – 2027год. 15-этажный дом с многофункциональными бизнес-апартаментами для комфорта жителей и владельцев бизнеса. Только сейчас вы сможете приобрести недвижимость в доме «Атлантик» на самых выгодных условиях - цена м2 именно сейчас находится на минимальной планке. Расположение и инфраструктура: Цены от застройщика, подбор и консультация бесплатны! Способы оплаты при покупке: Указанная цена и наличие данной квартиры актуальны на 20.03.2024 Помогу продать Вашу квартиру и купить новую! Бесплатно проконсультирую по объектам-новостройкам! Смотреть похожие предложения', 'SALE', '/sale-flats/object/3286814/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (64, 2, 9, 1547, '2024-05-21 14:42:13.133681', '2024-05-21 14:42:13.13368', '994f89bc-af7d-45c4-81ea-42aa8c855c63', 'Сдается в аренду просторная 2-комнатная квартира площадью 64.1 м2. Две отдельных комнаты: спальня, гостиная, кухня. Застекленная лоджия на две комнаты и кухню. В спальне удобный раскладной диван, шкаф для одежды. Гостиная отдельно от кухни! Квартира оснащена необходимой техникой для комфортной жизни: телевизор, стиральная машина, холодильник, телевизор, печь СВЧ, пылесос, мелкая бытовая техника. Раздельный санузел. Дом расположен в тихом центре с хорошо развитой инфраструктурой. Рядом магазины, кафе, школа, сад, гимназия. Хорошее транспортное сообщение. В нескольких остановках станции метро «Парк Челюскинцев» и «Московская». Квартира свободна к заселению! Не упустите свой шанс! Больше предложений смотрите на сайте Бюро городской недвижимости', 'RENT', '/rent-flat-for-long/object/3327714/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (83, 3, 3, 389133, '2024-05-21 14:45:02.968454', '2024-05-21 14:45:03.053439', '3c8a65eb-d811-4d50-86e2-144f2c21db2f', 'В продаже дом 7.2. в ЖК «Левада»! Успейте купить, квартиру от проверенного временем застройщика! Работаем напрямую от застройщика. Приобретая квартиру с нашим агентством, вы не платите НИКАКИХ комиссий! Квартиру здесь возможно приобрести в рассрочку или кредит. Планировка и цена действительны по состоянию на 22.04.2024 г. Жилой комплекс "ЛЕВАДА" – прекрасный вариант для жизни в Минске, на берегу реки Свислочь. Характеристики квартиры: · + Возведены межкомнатные перегородки; · + Квартира подготовлена под чистовую отделку; · + Разведена электрика; · + Установлены радиаторы отопления, унитаз; · + Металлическая входная дверь; · + Кладовые помещения на цокольном этаже (закреплены за отдельными квартирами) · + Потолки 2,7 м.; · + Дом оборудован бесшумными лифтами OTIS. Подробнее об инфраструктуре: · + Малоэтажная застройка (4 - 9 этажей) · + Сдача дома – 4 квартал 2024 г. · + Детские и спортивные площадки; · + Школа, детский сад, фитнес-зал; · + Система безопасности с контролем доступа и круглосуточным видеонаблюдением; · + Закрытые дворы, с доступом только у жильцов · + Подземный паркинг и вместительная наземная стоянка для жителей и гостей. · + В шаговой доступности живописная набережная реки Свислочь · + Удобный выезд на МКАД на авто. Менее 5 минут до 2-го кольца. Звоните или пишите в мессенджеры и узнайте подробности Окажем помощь в продаже вашей недвижимости для покупки этой новостройки! Бесплатная консультация по кредитованию! Поможем подобрать самый лучший вариант планировки, вид из окна и расположения дома! Услуги агентства БЕСПЛАТНЫ для вас. Полное сопровождение сделки до момента покупки квартиры! ООО «ЭТАЖИ юнайтед» УНП: 193673318 Договор № 631/1 от 22.01.2024 г. Лицензия на оказание риэлтерских услуг №02240/460 МЮ РБ от 03.04.2023', 'SALE', '/sale-flats/object/3314171/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (40, 2, 7, 217492, '2024-05-21 14:45:03.658679', '2024-05-21 14:45:03.673687', '29b76828-4cb1-4d0e-a131-bfd9e526fd4d', 'Продается отличная светлая квартира-евродвушка 39.5 м2 (площадь указана по СНБ) на 7 этаже 15-этажного дома «Белград» в ЖК «Минск-Мир». Возведены стены санузла. Панорамные окна, лоджия и два балкона с потрясающим видом на город.  Квартал «Центральная Европа» находится в центре жилого комплекса «Минск Мир». В благоустроенном квартале есть свой теннисный корт, баскетбольный стадион для командных игр и воркаут-территории.  Подъезд дома «Белград» сквозной. Один выход ведёт к наземной парковке. У автовладельцев будет возможность быстро подойти к машине и сразу же выехать на улицу Николы Теслы - в сторону кругового движения, откуда можно отправиться в любую точку города, либо уехать за МКАД. Рядом с домом будет расположен магазин «Виталюр» и подземная парковка на 100 мест.  Воспользовавшись вторым выходом, дети и мамы с колясками могут оказаться на безопасной площадке. Для малышей предусмотрены красочные и безопасные детские городки, которые расположены на прилегающей территории, где нет транзитного движения транспортных средств.  Распахнув двери можно будет увидеть эксклюзивное дизайнерское лобби. В просторном (47м2) фойе дома «Белград» есть стойка для консьержа, букшеринг, место для гостей, санитарная комната с пеленальным столиком, байк-бокс для любителей велоспорта (36 мест) и «паркинг» для детских колясок (14 мест).  В стилобате, расположенном на удалении 6 метров от дома, запроектированы 5 имеющих отдельные входы коммерческих помещений - место для старта успешного бизнеса, где откроются уютные кофейни или магазины, фитнес-центры или аптеки.  В квартире есть остекленная лоджия с выходом на неостекленный балкон. В доме «Белград» запроектированы два малошумных скоростных лифта, которые будут располагаться в лестнично-лифтовом узле. Один из лифтов панорамный с грузоподъёмностью до 1000 кг. Второй лифт - пассажирский с грузоподъёмностью до 400 кг.  В близлежащих кварталах расположены школы и детские сады, будут построены взрослая и детская поликлиника, медицинский центр, работают магазины, рестораны и кафе.  Один из выходов станции метро «Аэродромная» расположен в 2 минутах ходьбы от дома «Белград». Открытие этой платформы Зеленолужской линии Минского метрополитена ожидается в ноябре 2024 года.  Через дорогу от дома «Белград» откроется уникальный объект - Международный финансовый центр. Рядом распахнёт свои двери для покупателей один из самых больших торгово-развлекательных центров – Avia Mall  Поможем профессионально быстро и выгодно продать Вашу недвижимость в связи с покупкой вышеуказанного объекта недвижимости!', 'SALE', '/sale-flats/object/3323426/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (58, 3, 2, 53165, '2024-05-21 13:37:19.674817', '2024-05-21 13:37:35.393052', 'bb465932-c41d-4fb2-bf71-91abf7091c8f', 'Уютная, просторная, светлая и чистая с удобной планировкой трехкомнатная квартира в Новоколосово, готова к проживанию! Находится в 50 км от МКАД г. Минска (Р1 и Е30/М1). Квартира находится в хорошем состоянии. Рядом лес, до электрички 15мин. пешком. Природа везде, экологически чистое место – как в санатории). Дом кирпичный. Теплый. В квартире тихо. Уютный двор и придомовая территория, рядом с домом находится школа. Площадь СНБ 58,5 м2, жилая 40,3 м2, кухня 6,0 м2. Установлены счетчики воды и электроэнергии, телефон. Квартира расположена в тихом и спокойном районе , хорошие соседи. Рядом школа, близко детский садик, магазин, аптека, банк и банкомат. Недалеко парк, зона для отдыха и спортивных занятий. Рядом- места для отдыха -река Нёман, озера, в радиусе 20 км такие туристические объекты как: турбаза Высокий Берег, Мирской замок, Несвижский замок , музей Якуба Колоса и др. Отличное транспортное сообщение с Минском. До остановки вокзал -10-15 мин. пешком. Ходят также не только обычные электрички, но и Городские Линии и маршрутки. Инфраструктура: Евроопт, продуктовые магазины, детский сад, общеобразовательная школа, стадион, школа искусств, библиотека, дом культуры, больница, станция скорой помощи, аптеки, рынок, очень много различных магазинов, авторемонтные мастерские, шиномонтаж, магазины автозапчастей, городская баня, парикмахерские, дом быта, банк, почта, ремонт одежды, БТИ и нотариус, а так же кафе и клуб, Столбцовское шикарное и красивейшее озеро. Недалеко Музейный комплекс поэта Я.Коласа, турбаза «Высокий берег», Несвижский замок Радзивилов и Музейный комплекс Замок Мир. Отличное предложение как для отдыха так и для круглогодичного проживания! Звоните и приезжайте смотреть в любое удобное для вас время! Возможен торг. Хороший выбор для тихой и спокойной жизни в городе, так и для сдачи квартиры в аренду. Организовываем показы с понедельника и до пятницы, а также и по выходным дням. Всегда рады звонкам и покупателям!', 'SALE', '/sale-flats/object/3161204/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (65, 3, 8, 1160, '2024-05-21 14:42:12.094115', '2024-05-21 14:42:12.094114', 'bcf1bbd0-5276-4922-a73e-616751b9b887', 'Сдается трехкомнатная квартира на длительный срок! Минск. Пр-т Любимова, д.19/2 Общая площадь СНБ – 65,1 кв.м., жилая 63 кв.м., кухня 7,1 кв.м. 8/9 этажного панельного дома 1991 г.п. Квартиру никогда не сдавали. 3 изолированные комнаты. В квартире есть мебель и необходимая техника: индукционная варочная панель и духовой шкаф (Bosch), холодильник, микроволновая печь, электрочайник, тостер, стиральная машина, 2 телевизора, много мест хранения вещей. Инфраструктура: несколько школ, бассейн, 10-я гимназия, 2 супермаркета, хорошее транспортное сообщение. Договор на оказание риэлтерских услуг 19/1а (2024) от 11.03.2024 г.', 'RENT', '/rent-flat-for-long/object/3277904/');
