INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (66, 2, 5, 2417, '2024-05-21 13:37:19.682858', '2024-05-21 13:37:49.800354', 'aa3d7703-ae8d-4562-9b6a-c0d1cf51152c', 'Работаем по факту! Сдаётся новая просторная 2-х комнатная квартира с видом на Минск-Арену по адресу: ул. Нарочанская, дом 4 (мкр-н Лебяжий). Квартира полностью оборудована всей необходимой мебелью и техникой для комфортного проживания: холодильник, стиральная машина, плита, духовой шкаф, телевизор, мелкая бытовая техника, вытяжка, при необходимости можно доукомплектовать бытовой техникой. Много мест для хранения: распашной шкаф в коридоре, шкаф в спальне. Хороший вид из окна. Рядом есть абсолютно все для комфортной жизни, в шаговой доступности: магазины, супермаркет, кофейни, рестораны, ТЦ "Арена-Сити", велодорожки, набережная р. Свислочь. Новый элитный дом с видеонаблюдением и парковкой со шлагбаумом. Есть возможность арендовать парковочное место в подземном паркинге. ООО «Риэлти Фокс» УНП 193293123 Лицензия Минюста РБ № 02240/381 от 30.08.2019 г. Договор № 157/1а от 23.04.2024', 'RENT', '/rent-flat-for-long/object/3315021/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (49, 2, 5, 118895, '2024-05-21 14:42:13.133681', '2024-05-21 14:42:13.149306', 'c0ce5508-fbd5-4825-93be-d001898ae29a', 'Предлагаем купить 2-комнатную квартиру по ул. Лейтенанта Рябцева (Дубровка) в г.Бресте. Площадь: общая 48,5/46,9 м2, жилая 27,3 м2, кухня 7,7 м2, панельный дом 1978 г.п., этаж 5/5, раздельный с/у, два балкона. Теплая и уютная квартира с ремонтом: окна -стеклопакеты, на полу ламинат/плитка, на стенах обои, потолки – снежка, в санузле современная плитка, заменены трубы, входная дверь металлическая, межкомнатные- экошпон. Доброжелательные соседи. Во дворе достаточно места для парковки, детская площадка. Отличное месторасположение: в шаговой доступности остановки общественного транспорта, магазины и т.п Код 23421 Договор № 421 от 08.11.2023г. Торг', 'SALE', '/brest-region/sale-flats/object/3185171/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (72, 3, 4, 284444, '2024-05-21 14:45:03.673687', '2024-05-21 14:45:03.689326', '54e1d761-f5bb-44c7-9f8d-f4e639929c6e', 'Трёхкомнатная квартира от застройщика без комиссий и переплат для тех, кто ценит комфорт, удобное расположение и развитую инфраструктуру. Звоните или пишите в мессенджерах Viber / Telegram / Instagram ЖК «Минский квартал» расположен в микрорайоне Грушевка, недалеко от одноименной станции метро и проспекта Дзержинского. Комплекс включает: Характеристики дома №4: Сдача объекта: январь 2026 года. Процент строительной готовности дома на 01.04.2024 года - 38%. Условия оплаты: Покупка квартиры от застройщика - выгодно и безопасно! Бесплатно: подбор, сопровождение, консультация по кредитованию и рассрочке. Для решения жилищного вопроса вы можете продать свою квартиру для покупки новостройки. Покупка новостройки - выгодная инвестиция в будущее! Цена, планировка и наличие актуальны по состоянию на 05.04.2024г.', 'SALE', '/sale-flats/object/3299803/');
