INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (125, 4, 16, 5478, '2024-05-21 14:42:04.589628', '2024-05-21 14:42:04.74661', 'c83fc0bc-627b-4a4e-a43a-efa5cc344db2', 'Первое заселение! Дизайнерская 4-комнатная квартира в ЖК Маяк Минска, ул.Туровского, д.20 16/16 этажного блочного дома. Площадь СНБ 124,8 кв.м. Высота потолков 3м. Полная комплектация мебелью и техникой. Сдается официально только на длительный срок. Сделан дизайнерский ремонт с использованием качественных материалов отделки. Бытовая техника: кондиционер, посудомоечная машина, микроволновая печь, духовой шкаф, варочная поверхность, стиральная машина Samsung, бойлер, электрочайник, система фильтрации воды. Установлен SMART TV в гостиной. Возможна установка в спальни. Два санузла: 2 унитаза, ванна, душ, качественная сантехника. Качественная двуспальная кровать с ортопедическим матрасом. Множество мест для хранения: шкаф-купе и комод в коридоре, шкафы-купе в каждой комнате и коридоре. Новый дом с квартирами без ремонтов. Чистый подъезд. Огороженная территория, благоустроенный двор с детской площадкой. Национальная библиотека и прогулочные зоны поблизости. Крайне развитая инфраструктура в шаговой доступности: кофейни и рестораны, ТЦ Дана Молл, БЦ Променад, магазины, аптеки, метро Восток. Договор на оказание риэлтерских услуг 135/1а (2023) от 08.12.2023 г.', 'RENT', '/rent-flat-for-long/object/3207811/');
