INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (72, 3, 1, 1450, '2024-05-21 13:36:54.564969', '2024-05-21 13:36:54.580833', '8293be26-7489-4275-852b-8a57f0616407', 'Адрес: ул.Плеханова д.56/2, лучший спальный район Серебрянка В 15-ти минутах от Метро Партизанская. Количество комнат 3,в том числе раздельных 3 Этаж: 1-й высокий из 9-ти. Тип планировки: улучшенный проект. Материал стен: железобетонные панели. Метраж квартиры: общ. 72 кухня 9м2 Состояние квартиры: хороший ремонт. Квартира делалась для себя – переехали в дом, поэтому сдают. Кухня: кухонная мебель, вытяжка, газовая плита, духовка, микроволновка, тостер и холодильник включены в стоимость. Лоджия: две. Обе застеклены и отделаны. Санузел раздельный. Полностью в плитке и с хорошей сантехникой. Жилые комнаты: три раздельные комнаты с полной отделкой и меблеровкой, включая телевизоры. Подъезд: аккуратное состояние. Инфраструктура: Эталон инфраструктурного спального района: много транспорта (целых 2 крупных направления с множеством маршрутов), школы, поликлиника через дорогу и детские садики во дворе. Количество банков, магазинов и услуг не счесть. Дворы зеленые, рядом огромная велодорожка. БОНУС: возможна аренда с выделенным местом на крытом паркинге.', 'RENT', '/rent-flat-for-long/object/2227464/');
