INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (30, 1, 4, 113475, '2024-05-21 13:36:53.900807', '2024-05-21 13:36:53.91461', 'e65ad927-cb91-41c6-b6c9-7df91a578aa3', 'Многофункциональный и деловой, жилой и развлекательный, спортивный и финансовый комплекс Minsk World возводится на взлётных полосах первого белорусского аэропорта «Минск-1».   Лучшее время для инвестиций!   В Minsk World реализуется передовая градостроительная концепция «15-минутный город», предусматривающая нахождение в шаговой доступности всех объектов, необходимых для жизни детей и взрослых, пожилых людей и лиц с ограниченными возможностями.  Вместе с домами, именованными в честь прославленных мировых столиц, в кварталах, которые носят названия континентов и материков, работают и/или запроектированы:   Новостройки Minsk World  Команда белорусских и зарубежных градостроителей работает над воплощением в домах многофункционального комплекса лучших тенденций современной мировой архитектуры.  Minsk World — это 21 жилой квартал, в каждом из которых расположено от 10 до 12 красивых монолитно-каркасных зданий.  В домах комплекса проектируются как небольшие студии, так и просторные пентхаусы, а также престижные квартиры с собственными террасами и отдельным входом.  В новостройках Minsk World вас ждут:   Прилегающая территория  Здесь нет транзитного движения транспортных средств. Это место отдыха для взрослых и детей с площадками для занятий спортом и детских игр, теннисными кортами и стадионами для баскетбола. На территории каждого квартала работает, строится или запроектирована школа либо детский сад.  Комфорт автолюбителей  Парковочные места расположены с внешней стороны кварталов. Обеспечен прямой выезд на одну из новых магистралей Минска. В любую точку города на автомобиле можно доехать за 15 минут. Для наилучшей защищённости транспортного средства уже работают и строятся паркинги с видеонаблюдением, круглосуточной охраной, автоматизированным доступом владельцу в режиме 24/7. Некоторые из них интегрированы с торговым центром (дополнительный комфорт для автолюбителей).  Транспортная доступность  По периметру кварталов находятся остановки общественного транспорта. Маршрутная карта позволяет быстро добраться в удалённые районы Минска даже в часы пик. На территории многофункционального комплекса работает станция метро «Ковальская Слобода». Открытие станции метро «Аэродромная», где идёт отделка керамогранитом, ожидается в 2024 году.  Лучшее место для четвероногих друзей и владельцев  На территории многофункционального комплекса предусмотрены места выгула и базовой дрессуры для четвероногих друзей, где можно провести время с собакой, улучшив её физическую форму и подарив заряд бодрости.  Международный финансовый центр и ТЦ  Для реализации бизнес-проектов и построения успешной деловой карьеры в Minsk World возводится Международный финансовый центр. Рядом с ним появится один из самых больших (138 200 м2) в нашей стране торговых центров, где вы найдёте рекордное количество брендов (500 магазинов и бутиков), здесь также будет большой гипермаркет. На огромном (9000 м2) фуд-корте вас порадует широчайшая палитра блюд белорусской и зарубежной кухни. Появление этих объектов на карте многофункционального комплекса позволит соотносить комплекс с лучшими деловыми кварталами других стран и вызовет рост м2 в новостройках.  Minsk World – инвестиция в успех.', 'SALE', '/sale-flats/object/2806428/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (57, 3, 2, 115673, '2024-05-21 13:36:53.90657', '2024-05-21 13:36:53.92798', '6acbbee6-3c32-4220-b196-ae3ae26a08ef', 'Тёплая квартира в кирпичном доме с балконом и с хорошей инфраструктурой. Дом занимает самое привлекательное месторасположение, т.к. в шаговой доступности находятся все основные значимые объекты города. Также в радиусе 500 метров расположены продуктовые магазины, кафе и рестораны, банк, почта, парк, школа, гимназия, лицей, детский сад, торгово-сервисный центр, больница. В 10 минутах ходьбы находится озеро и пляж. В доме скатная крыша и есть технический этаж. В квартире можно сделать современную перепланировку с кухней-гостиной и двумя большими комнатами. У Вас есть отличная возможность сделать квартиру под себя, ведь вы платите относительно небольшую сумму только за квадратные метры, а не за чужой ремонт. В квартире уже проведены подготовительные работы для капитального ремонта в квартире - произведен демонтаж старых межкомнатных дверей и дверных проемов. Полностью демонтированы полы до цемента во всех комнатах. Звоните и приходите на просмотр ! Мы открыты к диалогу. https://www.realtcafe.com/', 'SALE', '/grodno-region/sale-flats/object/3161235/');
