INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (95, 2, 3, 2578, '2024-05-21 13:36:55.900708', '2024-05-21 13:36:55.900707', '727ba1d4-5a78-4f71-bc20-b0ad1d76db79', 'Сдается двухкомнатная квартира! Минск. Чехова, д.3 Общая площадь СНБ – 94,7 кв.м, жилая 53,3 кв.м., кухня 18 кв.м. На 3 этаже 7 этажного кирпичного дома 2002 г.п. Большая 2-комнатная квартира с техникой и мебелью. Престижный и тихий район в центре Минска. Площадь 94м2. Интерьер в классическом стиле. Квартира оборудована всем необходимым для комфортного проживания: большая гостиная и кухня с встроенной техникой, спальня, ванная комната. Квартира полностью меблирована и оснащена бытовой техникой: посудомоечная, холодильник, варочная панель, духовой шкаф, свч-печь, стиральная машина, кондиционер, телевизор. Придомовая территория огорожена шлагбаумами, оборудована системой видеонаблюдения. Есть возможность арендовать машино-место в крытом паркинге. Инфраструктура: в непосредственной близости находятся ТРЦ «Корона» и «Галерея», магазины «Соседи», «Евроопт», престижная гимназия, спортивные комплексы, кинотеатр, парк Победы и набережная реки Свислочь, станция метро «Молодежная», «Фрунзенская». При заселении оплачивается арендная плата и вносится возвратный депозит, равный сумме месячной арендной платы. Коммунальные услуги оплачиваются отдельно. Подробно проконсультируем и предоставим всю необходимую информацию. Договор на оказание риэлтерских услуг 32/1а(2024) от 18.04.2024 г.', 'RENT', '/rent-flat-for-long/object/3314825/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (79, 3, 4, 170449, '2024-05-21 13:36:56.520518', '2024-05-21 13:36:56.526267', '46cf6ddf-477c-49cd-8a6f-21c9f80b39ee', 'Предлагаем купить просторную трёхкомнатную квартиру в микрорайоне Речица, по ул. Дворникова на четвёртом этаже пятиэтажного кирпичного дома (год постройки 1985), с/у раздельный (облицован современной керамической плиткой), две з/с лоджии. Площадь общая по СНБ 79,2 м. кв., жилая 44,6 м кв., кухня 9,7 м кв. Во время ремонта произведена замена сантехнических труб. На полу в комнатах ламинат, плитка на кухне, в прихожей, межкомнатные двери деревянные, входная – двойная деревянная. Потолки окрашены снежкой, в зале – натяжной, в детской – многоуровневый. Лоджии застеклены, одна из них с отоплением и светом. Квартира полностью готова к проживанию, оборудована системой сигнализации. Отличные соседи, чистый аккуратный подъезд. Код 24108. Договор № 108 от 26.04.2024г.', 'SALE', '/brest-region/sale-flats/object/3317568/');
