INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (44, 2, 4, 70, '2024-05-21 13:37:02.736449', '2024-05-21 13:37:02.750675', 'eb5a80d0-9eac-417d-aeaa-e4937c36c66c', 'Квартира расположена на верхнем этаже в доме на высокой набережной реки Неман, в исторической части города. Из окон открывается потрясающая панорама на город. Дизайнерский ремонт (апрель 2020). В квартире есть все, чтобы Ваше пребывание и отдых были комфортными: большая кровать в спальне, раскладной диван в гостинной, телевизор, Wi-Fi, дизайнерская мебель. Для вашего удобства есть стиральная машина, гладильная доска, сушка, утюг, фен, гель-душ, шампунь, комплект полотенец каждому гостю, постельное бельё (включено в стоимость проживания). Кухня оборудована: индукционная плита, холодильник, свч-печь, посуда для приготовления и сервировки, чай, кофе, чистая вода. Для курящих есть открытый балкон. Дом расположен в центре города, что удобно как для туристов, так и тех, кто посещает город по рабочим вопросам, в пешей доступности множество магазинов, кафе, гипермаркет КОРОНА (до 23.00), в непосредственной близости ТРЦ ТРИНИТИ (до 23.00), рынок Южный. В 50 метрах от дома - прогулочная часть набережной реки Неман. Все главные исторические достопримечательности города видны из окон квартиры (Каложская церковь, Пожарная Каланча, Старый и Новый замки). Окна спальни входят на Францисканский костёл, что создаёт особую приятную атмосферу. Круглосуточное заселение, командированным предоставляются необходимые документы, наличный и безналичный расчет.', 'RENT_FOR_DAY', '/grodno-region/rent-flat-for-day/object/1977523/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (49, 1, 11, 322, '2024-05-21 13:36:56.950556', '2024-05-21 13:36:56.955562', 'c894f5e9-774f-4f68-9556-3b6148daaeea', '2 элитных апартамента для посуточной аренды класса «люкс» с дизайнерской отделкой и меблировкой европейского уровня. К вашим услугам апартаменты, оснащенные всей необходимой для комфортного проживания бытовой техникой. Если Вы захотите снять эту квартиру на сутки в Минске, ваш досуг разнообразят расположенные в 300-метрах Национальный театр оперы и балета, казино «ЭМИР», ночной клуб «West world Club», казино «Белая Вежа», казино « Миллениум», ночные клубы «Овертайм», The Black Door, рестораны «Семь комнат», «Double Coffe», выставочные комплексы ( Я. Купалы 27 и Победителей 14), прямой транспорт к многофункциональному комплексу « Минск-Арена». Любителям вкусно покушать предлагаем посетить рестораны европейской, японской и национальной белорусской кухни в историческом комплексе «Троицкое предместье» и «Раковское предместье», расположенные в шаговой доступности. Бронирование, весь пакет документов, гибкая система скидок, уборка производится по санитарным нормам гостиниц. При аренде от 10 суток и более цена договорная.', 'RENT_FOR_DAY', '/rent-flat-for-day/object/95382/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (55, 2, 6, 3544, '2024-05-21 13:36:57.874356', '2024-05-21 13:36:57.880808', '9c842c1b-50be-4dd8-9af9-cebce7dbe5ca', 'Эксклюзивное предложение! Светлая и просторная евродвушка в ЖК Vogue! Первое заселение. Дизайнерский ремонт из дорогостоящих материалов. Квартира делалась под себя. Панорамные окна. Спальня с гардеробной и рабочим местом. Полностью укопмлектованная кухня гостиная (посудомоечная машина, кондиционер с функцией обогрева, фильтр для воды). Прихожая с просторной гардеробной. Развитая инфраструктура - рядом Парк Челюскинцев, недалеко Дана Молл, множество магазинов и кафе в самом комплексе. Квартира сдаётся на длительный срок. Больше объявлений тут: www.instagram.com/garant.arenda Напишите нам в удобный для Вас мессенджер: Viber | Telegram | WhatsApp Ответим на Ваши вопросы, предоставим всю необходимую дополнительную информацию. Договор № 316/2а от 03.04.2024 ООО "АН Гарант Недвижимость" УНП 193584854 Лицензия: № 02240/435 выданная Министерством юстиции Республики Беларусь, от 25.01.2022', 'RENT', '/rent-flat-for-long/object/3306712/');
