INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (39, 1, 14, 1611, '2024-05-21 13:36:59.253298', '2024-05-21 13:36:59.26884', '3151de2c-1a47-481b-9f48-268cc8105a0e', 'Работаем по факту. Просторная стильная светлая квартира open space. Качественный ремонт, сантехника Grohe, кондиционер, посудомойка, холодильник, стиральная машина, телевизор, электроплита, духовка, мелкая бытовая техника, встроенная мебель и техника. Есть все необходимое для проживания. Высокие потолки, новый элитный дом с видеонаблюдением и консьержем. Рядом есть все для комфортной жизни: магазины, кофейни, фитнес-клуб. До ст.м. Институт культуры» 7 минут на общественном транспорте. Рядом останавливается автобус, до пл. Ленина 4 остановки.', 'RENT', '/rent-flat-for-long/object/3218803/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (69, 3, 7, 154661, '2024-05-21 13:36:57.970683', '2024-05-21 13:36:57.970682', '2599e908-3023-429a-b25f-f3bde6226994', 'Продается уютная 3-х комнатная квартира в хорошем состоянии, дом 1988гп., этаж 7/10, с прекрасным видом из окна. Светлые и просторные комнаты. В 2024году производился капремонт дома. Навесная кухня с газовой плитой и вытяжкой; командор металлическая входная дверь, межкомнатные двери массив дуба. Стены обои. Пол ламинат, плитка в кухне и санузле. Потолок снежка. Балкон и лоджия застеклены. Ванная и туалет облицованы плиткой. Счетчики учета воды и газа. Имеется подвал. В доме отличные соседи, что немаловажно для комфортного проживания. В шаговой доступности находится все, что необходимо для комфортного проживания: магазин Евроопт и другие торговые объекты, аптеки, банки, почта, гимназия, школы, детсады, минирынок, рестораны, Румлевский парк с зоной отдыха и река Неман, торговый центр Тринити, больница, Южный рынок, остановки общественного транспорта. Стоянка для авто. Хорошее транспортное сообщение и отличный выезд на трассу М6.', 'SALE', '/grodno-region/sale-flats/object/3323175/');
