INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (60, 3, 2, 304700, '2024-05-21 13:36:58.652971', '2024-05-21 13:36:58.670532', 'e5cf3103-e67d-430e-ab79-b685c09683f1', 'Скидка%кредит.Запись на показ.Звоните,все расскажу.Алёна. Дом сдан! VIP квартира в элитном ЖК «Парк Челюскинцев» Помощь в получении кредита в BYN и в продаже Вашей квартиры +Бронь новостройки. ЖК считается одним из самых востребованных и комфортных районов для проживания. Квартиру можно за наличные и в кредит (бесплатные консультации по телефону и в офисе) . Дом сдан! Жилой комплекс полностью построен. Расположен на пересечении проспекта Независимости и ул. Макаёнка. Преимущества: Парк культуры и отдыха имени Челюскинцев и Центральный ботанический сад. От метро 6 мин: «Московская» и «Парк Челюскинцев». От комплекса «Парк Челюскинцев» 1ст.метро - находится крупнейший в регионе торгово-развлекательный центр Dana Mall. Скоростные, бесшумные лифты – OTIS. Жилой комплекс расположен в одном из самых востребованных и комфортных районов столицы. На территории комплекса просторная парковка, огороженная детская площадка, благоустроенный двор. Прямо в доме находится новейший современный детский сад и школа развития. Безупречно развитая инфраструктура. Указанная цена и планировка актуальна на 17,04,2024. Звоните (viber telegram) Алёна . ООО «ЭТАЖИ юнайтед» УНП: 193673318 Договор 1253/1 от 26.02.2024 Лицензия на оказание риэлтерских услуг No02240/460 МЮ РБ от 03.04.2023', 'SALE', '/sale-flats/object/3310778/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (68, 3, 4, 309289, '2024-05-21 14:42:05.757712', '2024-05-21 14:42:05.794063', '6c9b07f7-9208-41cc-9e2d-bd5e419db2d4', 'Продается отличная квартира в тихом месте м-на Сухарево с видом на парк Семейный сквер. К проживанию готова полностью, вся мебель и техника остается. В 2019 г был обновлен ремонт: обои и паркетная доска (дуб/клен), окна стеклопакеты. Кухня выполнена из крашеного МДФ, пол с электр.подогревом. Квартира -распашенка,хорошо проветривается,летом не жарко. Прекрасное место для любителей тишины и природы, все необходимое в шаговой доступности. В услугах агентств не нуждаемся, просьба не беспокоить!!!!!!', 'SALE', '/sale-flats/object/3323415/');
