INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (39, 1, 4, 999, '2024-05-21 14:42:09.431345', '2024-05-21 14:42:09.444286', '0c83864e-a8cd-4ebc-8b24-d31e44d60e35', 'Сдается однокомнатная квартира – студия в отличном состоянии на длительный срок. Общая площадь 38,7 кв.м., жилая 17,2 кв.м., кухня 8,9 кв.м., санузел 5,1 кв.м., лоджия 7,9 кв.м. 4/9 монолитного дома. 2014 г.п. Дом расположен напротив ЖК Олимпик. Светлая, теплая квартира в отличном состоянии. Новая мебель. Квартира укомплектована новой импортной техникой: холодильник, стиральная машина, пылесос, микроволновка и т.д. В шаговой доступности рынок Ждановичи, магазины. Договор на оказание риэлтерских услуг 27/1а (2024) от 26.03.2024 г.', 'RENT', '/rent-flat-for-long/object/3049776/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (93, 3, 9, 5604, '2024-05-21 14:42:11.605131', '2024-05-21 14:42:11.60513', 'ecf86024-0552-4b15-bd11-f01a892dfe34', 'VIP-квартира в центре Минска!  Квартира расположена в самом престижном ЖК «Славянский квартал», в центре столицы, в доме комфорт-класса! Проспект Победителей, 27. - - - - - - - - - - - - - - - - - - - - ЖК «Славянский квартал» - один из самых привлекательных, респектабельных и востребованных жилых комплексов столицы, в котором создана уютная, доброжелательная среда для жизни, работы и отдыха. - Расположена квартира на 9-этаже 19-этажного каркасно-блочного дома 2012 года постройки. Площадь квартиры составляет, кв. метров: общая – 93,3/ жилая – 50,5/ кухня – 13,5. Квартира представляет собой изысканное сочетание роскоши и комфорта! Выполнен ремонт по дизайн-проекту, по которому предусмотрено все до мелочей. Квартира состоит из двух жилых комнат: мастер спальни со своим сан узлом и обустроенной детской с двумя спальными местами, просторной гостиной, кухни, 2 санузлов, прихожей, гардеробной, и лоджии. В отделке квартиры и оформлении интерьера использованы высококачественные материалы и оборудование. В жилых комнатах - паркетная доска дуб золотистый (Австрия). В коридорах, санузлах - теплый пол, плитка. Кухня и корпусная мебель выполнены по индивидуальному заказу. - Установлена система кондиционирования и приточно-вытяжная установка с рекуперацией тепла (очищает, нагревает и подает свежий воздух). - В доме установлено круглосуточное видеонаблюдение, консьерж 24/7, подземный паркинг с выходом к лифтам. В подъезде - скоростные бесшумные лифты «Kone» (3 пассажирских, 1 грузовой). Оборудован отдельный выход на детскую площадку. Детей можно наблюдать из окна своей квартиры. - Инфраструктура развита на столько, что при желании возможно вообще не покидать территорию комплекса: тренажерный зал, банки, кафе, салон цветов, туристическое агентство, аптека, магазины, выделенные парковочные места, велопаркинг. В 9-ти минутах ходьбы станции метро «Фрунзенская», «Немига», «Юбилейная площадь». Рядом парк Победы, Комсомольское озеро, сквер Старостинская Слобода, исторический центр столицы (Троицкое и Раковское предместья, Верхний город), где с удовольствием можно отдохнуть, находятся в шаговой доступности. - Отлично развитая инфраструктура, безопасность, респектабельные соседи - все, что необходимо для комфортного проживания. - - - - - - - - - - - - - - - - - - - - ООО «Экспресснедвижимость-риэлт», УНП 193505113, лицензия №02240/409 от 05.03.2021 г., договор на оказание риэлтерских услуг № 33/1а от 10.07.2023 г.', 'RENT', '/rent-flat-for-long/object/3187857/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (89, 3, 4, 3544, '2024-05-21 13:36:58.676161', '2024-05-21 13:36:58.680669', '20d07799-6ba3-4edc-967a-6e8df782eaff', 'Сдаётся впервые с дизайнерским интерьером квартира в одном из самых престижных районов столицы Маяк Минск, : ул. Кирилла Туровского 10. Уют и простор в классическом стиле. Две отдельные спальни, кухня гостиная, два санузла и застекленная лоджия . В квартире качественный ремонт, импортная мебель и техника. Имеется все необходимое для комфортного проживания :мебель, бытовая техника, мелкая бытовая техника, посудомоечная машина, встроенная СВЧ-печь и духовой шкаф, постельные принадлежности, кухонная и столовая посуда, 2 ЖКИ телевизора, Спутниковое телевидение, интернет. Дом повышенной комфортности с видеонаблюдением , чистый подъезд, консьерж, благоустроенный двор. Развитая инфраструктура района: недалеко от дома один из крупнейших торговых центров «DANA MALL» с большим количеством магазинов, аптек, кафе, высокотехнологичным кинотеатром. Национальная библиотека. Общеобразовательные школы, детские сады. Станция метро «Восток». В шаговой доступности парк. Прекрасный выбор для арендаторов, ценящих комфорт! Больше объявлений тут: www.instagram.com/garant.arenda Напишите нам в удобный для Вас мессенджер: Viber | Telegram | WhatsApp Ответим на Ваши вопросы, предоставим всю необходимую дополнительную информацию. Договор №342/2а от 12.04.2024 ООО "АН Гарант Недвижимость" УНП 193584854 Лицензия: № 02240/435 выданная Министерством юстиции Республики Беларусь, от 25.01.2022', 'RENT', '/rent-flat-for-long/object/3322864/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (65, 1, 12, 130, '2024-05-21 13:36:59.253298', '2024-05-21 13:36:59.26884', '0bee1e29-e870-4f63-92a3-0f7bf0e78665', 'В центре Минска в новом жилом комплексе бизнес-класса Каскад на 12 этаже 25 этажного дома предлагаем для вашего комфортного отдыха красивую и уютную дизайнерскую квартиру с отдельной спальней, большой джакузи для двоих, камином и кондиционером в каждой комнате. В квартире выполнен дизайн света- разнообразные неоновые лучи и подсветки . Ванная комната оборудована большой просторной гидромассажной ванной- Джакузи для двоих с множеством подсветок всех цветов радуги . Обустроенная лоджия с прекрасным видом на город. Вся бытовая техника в наличии. Посуда для приготовления и сервировки. Постельное бельё полотенца средство гигиены в наличии. Фен и гладильные принадлежности. Wi-fi. Вся инфраструктура, метро в 3 минутах ходьбы шаговая доступность. 2 км от ж/д Вокзала 2 км от Немига и всех достопримечательностей города Минска. Заезд 13-14 часов. Выезд 12:00. По договорённости время заезда выезда можно корректировать. Будем рады принять вас! Добро пожаловать! Внимание! Квартиры сдаются только для пары или семьи! Вечеринки и мероприятия строго запрещены! Валерия (хозяйка)', 'RENT_FOR_DAY', '/rent-flat-for-day/object/851571/');
