INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (37, 1, 1, 67020, '2024-05-21 14:42:07.116029', '2024-05-21 14:42:07.116029', '3330c948-df8f-4087-a8fe-65ef0f5c5659', '№ 530151 Однокомнатная квартира Северный микрорайон , ул. Центральная. Квартира расположена на 1-м этаже панельного 9-ти этажного дома, 1982 года постройки. Общая площадь квартиры составляет 37,2 м2, жилая площадь 17,1 м2, кухня - 7,5 м2. Удобная планировка: просторная жилая комната - 17,1 м2, светлая кухня - 7,5 м2, большой совмещенный санузел, коридор - 5,04 м2, отдельное помещение кладовой, Высота потолков - 2,5 метра. Стандартное жилое состояние: входная дверь металлическая, на полу лежит паркет, на стенах обои, межкомнатные двери деревянные, потолок натяжной, сантехника типовая. Чистый подъезд. Тихий спокойный двор со стоянкой для автомобилей. Район с развитой инфраструктурой. Рядом с домом находятся: продовольственный магазин, аптека, школы, детские сады, магазин хозяйственных товаров, рынок, детская поликлиника. В шаговой доступности остановки общественного транспорта. Рядом с домом расположены дом культуры и красивая зеленая аллея. Договор № 151/5 от 08.12.2023, ООО Бугриэлт, УНП 291139313, лицензия № 02240/245 от 05.02.2013 на право осуществления деятельности по оказанию юридических услуг (риэлтерские услуги). Приглашаем дружить с «Бугриэлт»', 'SALE', '/brest-region/sale-flats/object/3207706/');
