INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (32, 1, 3, 80, '2024-05-21 13:36:59.253298', '2024-05-21 13:36:59.270349', 'c9b334b4-bd9f-4403-87bc-b902342ffa41', 'Есть горячая вода. Бесконтактное заселение, отчетные документы, все необходимое. Профессиональная уборка перед заселением, свежее постельное белье, полотенца. Рядом все достопримечательности (летний Амфитеатр, Свято-Успенский собор, музеи, церкви, площадь Победы, набережная Западной Двины, парк Победителей), Марко-Сити, университет МИТСО, областной стоматологический центр, обл. детская больница, кафе, банки, магазины и т.д. Парковка возле дома, недалеко охраняемая стоянка. ТV, Wi-Fi, фен, утюг, постельное белье, полотенца, кухонные и принадлежности для ванны, чай, кофе и т.д. Воскресенье-Четверг: 80 бел.руб. Пятница, Суббота: от 100 бел. руб., праздники по договоренности. Связаться можно через мессенджеры: Viber WhatsApp Telegram Квартира в центре в районе железнодорожного и автовокзала', 'RENT_FOR_DAY', '/vitebsk-region/rent-flat-for-day/object/3012191/');
