INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (45, 2, 4, 231991, '2024-05-21 13:37:00.500784', '2024-05-21 13:37:00.505498', '8c3c035e-f0ed-4803-b136-ae6f99e02f6b', 'Прекрасная квартира в районе с развитой инфраструктурой. В доме выполнен капремонт в 2014 году, когда делали качественно и меняли всё. Дом обшит шубой. Квартира теплая. В квартире сделан качественный ремонт для себя: Полы по технологии Knauf суперпол(пеноплекс/керамзит + плиты кнауф), ламинат на древесной подложке. (старый деревянный пол демонтирован) Спальня: Оборудована гардеробной, потолок натяжной с аккуратной люстрой и подсветкой RGB по периметру для создания интимной обстановки, 4 точки с розетками, рабочее место(с розетками, сетевым кабелем от модема, телефонный кабель, hdmi к любому из телевизоров), сетевой кабель от модема к телевизору, розетки возле кровати, бра возле кровати включаются прикосновением(3 режима), бризер(приточная вентиляция). Гостиная: 6 точек с розетками, модем в центре квартиры за телевизором, рабочее место с кабелем hdmi, сетевым кабелем, розетками. Парящая мебель под ТВ зоной. Полоток натяжной с подсветкой RGB и люстрой. Кондиционер Gree(с отдельной электро-линией к щитку). Балкон: застеклен, обшит, два алюминиевых шкафа для хранения. Кухня: оборудована духовкой Samsung, посудомоечная машина и плита Bosch, вытяжка, фильтр для воды. Отдельный электро-кабель для духовки и посудомоечной машины. В целом на кухне 7 точек с розетками. Потолок натяжной со световыми линиями. Прихожая: шкаф для верхней одежды (в шкафу расположен электро-щиток), шкаф для обуви. Две розетки. Проходные выключатели света в прихожей. Натяжной потолок со световыми линиями. Ванная: плитка, акриловая ванная, шкаф с розетками(отдельная линия для стиральной машины), гигиенический душ, инсталляция, вытяжка с настройкой режимов(например по влажности, по выключателю, так и так) Стены выровнены и покрашены моющейся краской, розетки SCHNEIDER, сантехника LEDEME. Есть все схемы проводки. Бонусом идет подвал. Инфраструктура: до метро/трамвая 10 минут пешком (1км), рядом с домом 43-й автобус до ул. Дружной, магазины, парк с рекой в 100 метрах от дома, много детских садиков, школа через дом с углубленным английским и новым стадионом, бассейн в 1км, поликлиника в 1 км, новая детская поликлиника в 1.2км, много кружков и секций по интересам. Очень зеленый и тихий район. Хорошие соседи. Нет никаких проблем с парковкой, авто всегда возле подъезда. В 250 метрах от дома для желающих есть так же платная авто/вело парковка.', 'SALE', '/sale-flats/object/3323168/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (75, 3, 10, 2739, '2024-05-21 14:42:05.757712', '2024-05-21 14:42:05.773349', 'c4fd53a1-d1de-4ef6-8b8c-73a4b1c17ec5', 'Сдается видовая евротрешка в ЖК «Маяк Минска» ул. Туровского, д. 2. 10/11 этажного каркасно-блочного дома 2015 года постройки. Общая площадь 75 м2, жилая площадь 72 м2 Ремонт выполнен с использованием высококачественных материалов. Первое заселение! H=3м Панорамные окна. Квартира состоит из 2 изолированных комнат и кухни-гостиной. Ремонт выполнен с использованием высококачественных материалов. Имеется возможность аренды или приобретения машиноместа в подземном паркинге. От входа в подъезд в шаговой доступности станция метро «Восток», ТЦ «Дана Молл». Многочисленные магазины, школа, детские сады, медицинские и фитнес-центры, банки, аптеки, а также другие объекты сервисного обслуживания и досуга. Договор на оказание риэлтерских услуг 111/1а (2023) от 13.09.2023 г.', 'RENT', '/rent-flat-for-long/object/3140092/');
