INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (43, 1, 2, 967, '2024-05-21 13:37:03.366063', '2024-05-21 13:37:03.370687', '9fa22a54-cfdf-4775-8919-b8ca9183ed32', 'Сдается 1-комнатная квартира в 5-ти минутах от метро Уручье в доме повышенной комфортности. Квартира с хорошим ремонтом, большая по площади 42 кв.м, с классической планировкой: жилая комната и изолировання кухня. После клининга. Мебель частично кухонная, 2 раскладывающихся дивана, шкаф-купе в коридоре. Две квартиры в тамбуре, который очень просторный и там можно оставлять велосипеда. Ожитой район, в шаговой доступности парковая зона, ТЦ Спектр, наземный транспорт во все районы города, удобный выезд на МКАД. Заселение с 01.06. Смотреть и бронировать можно заранее. ООО «Партнер для всех», УНП 690665135, лицензия Министерства юстиции Республики Беларусь № 02240/321 от 02.12.2016, договор на оказание риэлтерских услуг № 70/2а от 15.09.2021', 'RENT', '/rent-flat-for-long/object/3322495/');
