INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (42, 2, 16, 200763, '2024-05-21 14:42:13.323058', '2024-05-21 14:42:13.338684', '4cb5861b-14e2-4977-91b7-13782052261b', '« Минский квартал»- это жилой комплекс состоящий из наземного паркинга и четырёх домов, выполненных в едином архитектурном стиле. На первых этажах разместится коммерческая, социальная и бытовая инфраструктура- магазины, аптеки, детский сад и другое.  Конструктивная схема здания - каркас. Наружные стены выполнены из железобетонных однослойных панелей с утеплением. Внутренние стены, внутриквартирные перегородки из силикатных блоков. В квартире выполняется стяжка пола и штукатурка стен. В квартирах устанавливаются двухкамерные стеклопакеты ПВХ , лоджии остеклены. Устанавливается входная дверь, из сантехники - унитаз. Разводка электрики с установкой розеток и выключателей, подводка оптоволокна. Установка счетчиков воды и электроэнергии. Горизонтальная разводка труб отопления с возможностью подключения счетчиков тепла. Лифт грузопассажирский марки OTIS. Кладовые помещения закреплены за определенными квартирами; В стоимость данной квартиры включена кладовая 4 м2; Высота потолка - 2,5 м. Станция метро «Грушевка» находиться в 8 минутах ходьбы. Остановка общественного транспорта на проспекте Дзержинского- 4 минуты пешком. Детский сад №85, школа№ 3, магазин «Санта». Недалеко ж/д вокзал, автовокзал.  Подбор вариантов квартир, кредитования; консультация; сопровождение сделки-бесплатно. Возможность рассрочки, при использовании собственных средств от 30% Заявленная сдача дома 2026 год, ожидаемая 1 квартал 2025 года. Стоимость и наличие квартир актуально на дату размещения объявления 30.03.2024 года.', 'SALE', '/sale-flats/object/3294723/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (92, 3, 7, 3222, '2024-05-21 13:37:01.560762', '2024-05-21 13:37:01.560761', 'ca30b8e5-c6b5-4cf5-bd26-3ea76fc23958', 'Благоприятная экология- рядом зелена зона, река; удобное расположение- в шаговой доступности ст.м. «Восток», рядом Национальная библиотека; развитая инфраструктура- недалеко от дома один из крупнейших торговых центров «DANA MALL», с большим количеством магазинов, кафе, высокотехнологичным кинотеатром. В квартире выполнен дизайнерский ремонт, авторская лепнина. Площадь 92,3 кв.м. Для комфортного проживания квартира укомплектована импортной мебелью и бытовой техникой: посудомоечная машина, индукционная плита, духовой шкаф, холодильник, стиральная и сушильная машины, ЖК телевизоры, бойлер. Два санузла. Установлен камин. Вы можете связаться с нами по Viber, WhatsApp, Telegram ООО "Твоя столица", УНП 101136973, лицензия №02240/15 от 17.02.05г. Договор на оказание риэлтерских услуг № 673/1а, от 22.09.2023. Смотрите также еще более 100 квартир с ремонтом в аренду. Фото, описание, цены. Подберем квартиру в длительную аренду под Ваши требования и поможем снять без риска ONLINE-сервисы и технологии для комфорта Только актуальные предложения Оплата услуг после заключения договора аренды Карточка рассрочки «Халва» Вам может быть интересно: База арендаторов Сдать квартиру и получать доход, если Вы находитесь не в Минске Подобрать жилье в аренду для специалистов компании', 'RENT', '/rent-flat-for-long/object/1594146/');
