INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (94, 3, 3, 4833, '2024-05-21 13:37:02.31065', '2024-05-21 13:37:02.315655', '5d7f3bf4-4c49-4e0c-aafd-b0518c387277', 'VIP-квартира! Первое заселение! Сдается трехкомнатная квартира в одном из самых востребованных районов Минска - ЖК "Маяк"! С 3 этажа открывается прекрасный вид на бульвар. Общая площадь 98.6 м.кв. Просторная гостиная, спальная комната ,детская и отдельная кухня. Два санузла с ванной и душевой. Полная комплектация техникой и мебелью: бойлер, посудомоечная машина, микроволновая печь, духовой шкаф, стиральная машина, сушильная машина, Smart TV в гостиной. Итальянская мебель, большая двуспальная кровать, ортопедический матрас. Удобная система хранения вещей, а так же отдельная гардеробная. Развитая инфраструктура района: недалеко от дома один из крупнейших торговых центров «DANA MALL» с большим количеством магазинов, аптек, кафе, высокотехнологичным кинотеатром. Национальная библиотека. Общеобразовательные школы, детские сады. Станция метро «Восток». В шаговой доступности парк. Новый дом, чистый подъезд, консьерж. Прекрасный выбор для арендаторов, ценящих комфорт! Больше объявлений тут: www.instagram.com/garant.arenda Напишите нам в удобный для Вас мессенджер: Viber | Telegram | WhatsApp Ответим на Ваши вопросы, предоставим всю необходимую дополнительную информац ию. Договор №369/2а от 22.04.2024 ООО "АН Гарант Недвижимость" УНП 193584854 Лицензия: № 02240/435 выданная Министерством юстиции Республики Беларусь, от 25.01.2022', 'RENT', '/rent-flat-for-long/object/3313790/');
