INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (82, 3, 1, 193004, '2024-05-21 14:45:05.225124', '2024-05-21 14:45:05.242292', '5f9c9e1d-643a-466f-9fdd-1729621a77a3', '№ 230657 Продается трехкомнатная квартира в городе Бресте по ул. Красногвардейская. Квартира расположена на 1-м этаже 5-ми этажного кирпичного дома,1998 года постройки. Общая площадь квартиры с лоджией составляет 83 м2, жилая площадь - 47,5 м2. Современная планировка: большая жилая комната - 18.6 м2, просторные спальни - 17.1 м2 и 11 м2, светлая кухня - 12,4 м2 с выходом на застекленную лоджию. Высота потолков - 2,5 метра.Окна в квартире выходят на две стороны, что обеспечивает хорошее освещение. Комнаты изолированные, что позволяет обеспечить приватность для каждого члена семьи. Квартира в хорошем состоянии: входная дверь металлическая, окна - стеклопакеты, межкомнатные двери - массив дерева,на полу доска.Санузел облицован плиткой.Район, где находится квартира, также обладает развитой инфраструктурой. В непосредственной близости расположены магазины, школы, детские сады,ресторан. Общественный транспорт также доступен, что обеспечивает удобное перемещение по городу. Лот 230657 Договор № 657/2 от 08.11.2023, ООО «Бугриэлт», УНП 291139313, лицензия № 02240/245 от 05.02.2013 на право осуществления деятельности по оказанию юридических услуг (риэлтерские услуги) Приглашаем дружить с «Бугриэлт»', 'SALE', '/brest-region/sale-flats/object/3185192/');
