INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (27, 1, 9, 165938, '2024-05-21 13:37:04.02068', '2024-05-21 13:37:04.028954', '78c2d5a3-369c-4c7f-bbb5-23efbc32b751', 'Именно для Вас продаётся уютная студия в жилом доме «Yoyogi Park» квартал «HappyPlanet/Счастливая планета». Почему стоит купить именно эту квартиру: -В квартире имеется два канализационных стояка, что позволяет вам удачно продумать дизайн проект данной квартиры. -Двухкамерные стеклопакеты в комнате. -Одним из приемуществ квартиры, является её располажение уже в обустроенной части Минск Мир. -В этом квартале планируется парк, в котором вы сможете с комфортом проводить свой досуг. -Окна располагаются на северо-востоке, не выходящие в окна рядом стоящего дома. -В доме три скоростных лифта ОTIS, один из которых панорамный. Звоните и договаривайтесь на просмотр! Отвечу на любые возникшие у вас вопросы по телефону. Ваш Александр.', 'SALE', '/sale-flats/object/3323163/');
