INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (28, 1, 5, 116518, '2024-05-21 14:42:09.424046', '2024-05-21 14:42:09.429452', '01a0357f-a5f5-4369-b22b-a2795c0f5c06', 'Скидки.Наличные и Рассрочка от 20% первый взнос. Звоните – все расскажу.. Консультация по телефону, Вайберу и в офисе.Алёна Стать владельцем апартаментов в Minsk World можно: За собственные средства (90% +10% после сдачи дома), В рассрочку (20 % первоначальный взнос) Без справок и поручителей. Нужен только П А С П О Р Т. Новый квартал у метро. Бронь 30 дней - при продаже Вашей квартиры с Этажами Юнайтед. Бесплатная консультация, скидки и подбор по телефону (Алёна) (viber, telegram) Работаем напрямую от застройщика по партнерской программе (без комиссий)!!! Новый формат. В апартаментах можно не только зарегистрироваться по месту жительства, но и создать юридический адрес компании, то есть зарегистрировать юридическое лицо. Есть возможность вести бизнес (виды бизнеса ограничены - не требующие реконструкции помещений). Отличная локация у метро (4мин) Апартаменты инновационного формата недвижимости с новыми возможностями для жизни и бизнеса. Дом расположен в нескольких минутах ходьбы до остановки по улице Жуковского, и в 4 минутах от станции метро «Аэродромная» (открытие станции запланировано на 2024 год). ФЦ станет всеобъемлющей экосистемой банковских, финансовых и вспомогательных услуг. Планируется, что здесь будет использоваться особая система льгот и стимулов для привлечения капитала и оказания финансовых услуг. Рядом с ним появится крупнейший в Республике Беларусь торгово-развлекательный центр Avia Mall с большим фуд-кортом и гипермаркетом, бутиками, в которых будут представлен широчайший выбор товаров отечественных и зарубежных производителей. Один из выходов ТРЦ Avia Mall будет интегрирован со входом на новую станцию метро «Аэродромная». Не упустите свой шанс стать собственником своей новой недвижимости! Консультации, подбор лучших вариантов, консультации и рассрочке - абсолютно Б Е С П Л А Т Н О! Продам Вашу квартиру максимально В Ы Г О Д Н О Новостройка сдача дома -2026 год Стоимость и наличие актуальны на 30,03,2024', 'SALE', '/sale-flats/object/3294454/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (33, 1, 15, 138576, '2024-05-21 13:37:02.725898', '2024-05-21 13:37:02.730406', '45d85682-43c2-4936-b3a3-8b701e2100b6', 'Выгодное предложение!!! Дополнительная скидка по телефону, звоните за более подробной информацией! Бронь на месяц при продаже Вашей квартиры Стоимость актуальна на дату размещения 02.05.2024. Подробную актуальную информацию уточняйте по телефону. Варианты оплат: - наличные средства 90% сразу, 10-20 % после сдачи дома! - длительная рассрочка (очень выгодная до 3 лет)! Дом — для бизнеса и проживания! Это возможность жить, работать, прописаться и зарегистрировать свою компанию именно по этому адресу. Цены от застройщика. Все консультации и помощь в покупке новостройки БЕСПЛАТНЫЕ! Заинтересовались? Тогда звоните, подберем выгодный вариант кредитования или рассрочки также абсолютно бесплатно! Срок сдачи дома – осень 2026 год. Цена указана без учета скидки!!! Инфраструктура: · Две станции метро: «Ковальская Слобода» уже работает, «Аэродромная» строится прямо в границах комплекса · Комплекс будет удобным и для автомобилистов. Границы очерчивают две важные транспортные магистрали Минска – улицы Кижеватова и Аэродромная. По ним можно быстро добраться не только в центр города, но и в сторону МКАД. Несколько минут, и вы на месте! · Зеленая парковая зона с фонтанами, со скульптурами, аттракционами, теннисными кортами, футбольным полем и баскетбольной площадкой · международный финансовый центр и крупнейший торговый центр MARA MAII · внутри квартала - детские площадки для разных возрастов детей, цветочницы, скамейки, вело парковки · в пешей доступности будет вся собственная инфраструктура Minsk World – взрослая и детская поликлиника, медицинский центр, кафе и магазины, парковки и заправки, спортивные залы и фитнес-центры Недвижимость продаётся по цене застройщика без комиссии! Поможем продать Вашу квартиру. Подберем лучший вариант с возможностью длительной брони! Звоните прямо сейчас для более подробной консультации и расчёта всех максимальных скидок!  ООО «ЭТАЖИ юнайтед» УНП: 193673318 Договор 52/1 от 05.01.2024г. до 03.01.2025г. Лицензия на оказание риэлтерских услуг №02240/460 МЮ РБ от 03.04.2023г.', 'SALE', '/sale-flats/object/3321273/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (350, 8, 7, 8055, '2024-05-21 13:37:02.755117', '2024-05-21 13:37:02.763168', '875f01f7-c0b6-4465-b4d9-ff5a3c1bba7e', 'Сдаётся в аренду эксклюзивная двухуровневая квартира в центре Минска. - У Вас есть уникальная возможность арендовать большую и просторную квартиру общей площадью 360 м.кв.(СНБ) в одном из самых респектабельных районов Минска. 9 раздельных комнат: шикарная гостиная с камином, 4 спальни, кабинет, 2 бытовых комнаты, комната для занятия спортом и восстановления. Кухня 26м.кв. Жилая площадь более 205м.кв. 4 санузла, расположенных как на первом, так и на втором этаже. - Сделан эксклюзивный ремонт. При отделке использовались импортные и высококачественные материалы. Встроенная кухня со всей необходимой техникой: посудомоечная машина, гриль, духовой шкаф, варочная панель, холодильник и морозильная камера. В комнатах на полу дубовый паркет, настил выполнен в соответствии со всеми стандартами качества. В комнатах установлены кондиционеры. - Имеется своя собственная сауна и джакузи прямо у Вас дома. -Кирпичный дом под видеонаблюдением и с консьержем. Территория огорожена и находится под охраной. Шикарный вид из окна. -Два машиноместа в подземном паркинге и парковочное место сразу возле подъезда. - Район с готовой развитой инфраструктурой. В шаговой доступности находится всё необходимое для комфортной жизни: ТЦ Корона, ТЦ Galleria Minsk, гимназия, школы, несколько детских садов, аптеки, банки, рестораны и кафе, спортивные залы, бассейн. -Рядом находится Стелла «Минск-город-герой» и музей ВОВ, парк Победы, набережная р. Свислочь, где можно прогуляться, насладиться природой и свежим воздухом. Отлично подойдет настоящим любителям спорта. -Приглашаем Вас на просмотр и лично убедиться всей красотой данного места и прекрасной атмосферой в квартире.', 'RENT', '/rent-flat-for-long/object/2701195/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (46, 2, 1, 70, '2024-05-21 13:37:03.365045', '2024-05-21 13:37:03.370687', '9320904e-2478-4f6f-8d8f-cc7f3422cf51', 'Подробнее на www.myrent.by Современная двухкомнатная квартира в непосредственной близости от вокзала. Это позволит приезжим не думать о поисках такси либо другого транспорта, а с перрона прямо на заселение. Свежий ремонт, новая мебель, современная техника и многие другие прелести не оставят никого равнодушным. Стоимость указана за воскресный день при двухместном размещении. Цена будних дней 80-120 р, пятница суббота 100-150 р.', 'RENT_FOR_DAY', '/gomel-region/rent-flat-for-day/object/3317922/');
