INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (85, 4, 1, 181726, '2024-05-21 13:37:09.260787', '2024-05-21 13:37:09.303241', 'd654fcf1-6f2d-4c47-aa7d-75a4cbf933a8', 'Продаётся 4-комнатная квартира в мкр. 19 д 13. Квартира находится на 1 этаже панельного дома. Год постройки 1993. Общая площадь 85,4 м2, жилая 54 м2, кухня 9,4 м2. В квартире четыре просторные не проходные комнаты. На полу уложена плитка и лиственница. Санузел раздельный (плитка). Две лоджии застеклённые, в одной имеется подвал для хранения. Окна все ПВХ, металлическая дверь. Квартира для большой дружной семьи. Район с развитой инфраструктурой, детские сады, школы, магазины, почта, аптеки, автобусные остановки всё в шаговой доступности. Агентство недвижимости «Юриэлт» гарантирует чистоту сделки. Приглашаем на просмотр всех желающих.', 'SALE', '/gomel-region/sale-flats/object/3247460/');
