INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (108, 3, 4, 7411, '2024-05-21 14:42:10.105656', '2024-05-21 14:42:10.105655', 'a8dc1f24-e812-426e-98e2-a47b98063b7a', 'Индивидуальный дизайнерский проект в самом центре Минска. ул.Киселева, д.17 Площадь 107,9/99,9/80,7 Самое сердце Минска. Парк Горького с его аллеями, лучшие рестораны и центральный проспект в пешей доступности. Но не смотря на суету города, абсолютно тихое и спокойной место. С собственной парковкой и незабываемой атмосферой. «Времена года» - уникальная и красивая постройка. Всего 4 подъезда, ухоженная территория, респектабельные соседи. Планировка: Пространство использовано максимально эффективно и продумано до мелочей. Спальня с собственной ванной. Большая гостиная с камином ( имитацией ) из гранита и уютной кухней. Детская комната, сделана с душой в светлых, гармоничных тонах. Гардеробная удобна и практична, а вторая душевая заряжает бодростью на весь день. Все выполнено из качественных материалов и гармонично сочетается друг с другом, в лучших традициях французского шика. Отделка: Итальянская цельная плитка, дубовый паркет, сантехника Villeroy & bosch, техника Bosch, итальянские светильники и ковры ручной работы. Посудомоечная, стиральная и сушильные машины, холодильник, полы с подогревом. Большой входной коридор и красивым и удобным шкафом для хранения. Каждая ручка и розетка выбрана с большой любовью и уважением к пространству этого дома. Огромный балкон, как отдельная территория для уютного чаепития. Высота потолков 3,5 м. Договор на оказание риэлтерских услуг 50/1а(2022) от 22.07.2022 Лицензия 02240/440 от 29.03.2022', 'RENT', '/rent-flat-for-long/object/3319886/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (132, 4, 8, 515536, '2024-05-21 13:37:09.254883', '2024-05-21 13:37:09.265815', '6d63e4aa-6cbc-4766-9e03-49c95d0cec71', 'Просторная и светлая квартира с улучшенной планировкой в кирпичном доме: светлая и просторная кухня 20м2, большие раздельные комнаты, два санузла, три утепленные лоджии. В квартире выполнен достойный ремонт из качественных, импортных материалов. Стены выровнены, сделана разводка электрики, в большей части квартиры установлен деревянные стеклопакеты. На полу – качественная плитка Сквирел (кухня, санузел), в комнатах и прихожей лежит добротный паркет. Почти вся мебель в квартире сделана из массива дуба включая межкомнатные двери. Квартира полностью готова к проживанию и не требует дополнительных вложений! Заселяйтесь и наслаждайтесь! Отличное место для большой семьи любящий комфорт. Бытовая техника: двухстворчатый холодильник BOSCH, варочная панель BOSCH, духовой шкаф BOSCH, посудомоечная машина BOSCH, итальянская вытяжка Best, бойлер на 50л, стиральная машина, установлен фильтр воды. Дом построен из кирпича, а это значит, что кроме отличной звукоизоляции он способен накапливать и долго хранить тепло. Более того, благодаря высокой тепловой аккумулирующей способности кирпича, в этом доме зимой будет тепло, и в летний зной прохладно. Развитая инфраструктура: Благоустроенность района, наличие объектов сферы услуг, образования и здравоохранения, банков и магазинов, сделают оплату счетов или поход за продуктами пятиминутным делом. Во дворе дома детский сад и школа. Зеленая зона (парк «Уручье») с водным каналом в 500 метрах от дома, позволит прекрасно проводить свободное время на свежем воздухе вместе с семьей или четвероногим другом, заниматься спортом. Этот парк станет вашим любимым местом для прогулок и отдыха. Хорошее транспортное сообщение: 3 минуты до метро «Уручье» 3 минуты от подъезда до остановки общественного транспорта. Более 20 маршрутов наземного транспорта: автобусы, маршрутные такси. Автомобилисты по достоинству оценят удобный выезд на МКАД. Чистая продажа! Ключи в день сделки! Поможем продать Вашу недвижимость для покупки этой квартиры.', 'SALE', '/sale-flats/object/3222056/');
