INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (33, 1, 16, 134362, '2024-05-21 14:42:10.588609', '2024-05-21 14:42:10.595589', '720e0077-91f8-4762-9e3f-aca07479d185', 'Наличные! Кредит! Рассрочка! 1. Услуги по подбору новостроек - бесплатные!!! 2. Напрямую от застройщика, Вы покупаете по цене застройщика и заключаете договор только с застройщиком! 3. Выполняем функцию отдела продаж застройщика В многофункциональных апартаментах можно: В будущем здесь появится современная и благоустроенная школа с бассейном и спортплощадками. Для велосипедов в квартале предусмотрены парковочные места. На внешнем периметре квартала создадут места для парковки транспортных средств. Жители могут по достоинству оценить инфраструктуру Minsk World, где всё находится в шаговой доступности, согласно концепции «15-минутного города». Детей радуют мини-парки – яркие, красочные, экологичные городки. Они обустроены в каждом квартале комплекса. Развита спортивная инфраструктура: территории для воркаута, баскетбольные площадки, теннисные корты. Внимание! Новые условия: На апартаменты действует рассрочка на 36 месяцев! Планировки и цены актуальны на 02.04.2024', 'SALE', '/sale-flats/object/3296259/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (41, 2, 4, 1611, '2024-05-21 13:37:09.260787', '2024-05-21 13:37:09.297818', 'adf219b8-e4e3-4f07-92e2-87f693361029', 'Сдаётся в аренду уютная евродвушка в новом современном ЖК «Минск мир», дом "Атланта". Первая сдача!!! Квартира располагается на 4 этаже. Сделан качественный ремонт. В квартире есть вся мебель и импортная техника. Встроенная кухня, холодильник, посудомоечная машина, электроплита и духовой шкаф, мелкая бытовая техника ( чайник, СВЧ печь). В квартире один телевизор. Оборудована спальня. Также имеется постельное белье и полный комплект посуды. В квартире присутствует большая просторная гардеробная, подогрев полов. Проведён интернет. Дом располагается вдоль нового проспекта Мира, обустроенный квартал. Отличное транспортное сообщение: остановки наземного транспорта и метро в шаговой доступности. ООО «Партнер для всех», УНП 690665135, лицензия Министерства юстиции Республики Беларусь № 02240/321 от 02.12.2016, договор на оказание риэлтерских услуг № 67/2а от 08.05.2024', 'RENT', '/rent-flat-for-long/object/3325955/');
