INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (81, 2, 3, 512314, '2024-05-21 14:42:10.59276', '2024-05-21 14:42:10.595589', '084ea789-c25a-4a6b-bee2-37e05a06bafa', '3-х комнатная квартира в ЖК комфорт класса «Колизей». Планировка евротрешка. Площадь указана по СНБ 81.4 м2 ЖК комфорт класса "Колизей", дом каркасно-блочный, 2013 года постройки, парковкой возле дома, обустроенной детской площадкой. Бесшумные, скоростные лифты. Благоустроенная придворовая территория. Видеонаблюдение у подъездов. В кухне на полу керамогранит с подогревом. Кухня изготовлена на заказ в «Шефкухни», фасады Еgger, фурнирута Blum, встроенная техника Bosch (печь СВЧ, духовой шкаф, варочная панель), холодильник Samsung, посудомоечная машина. В квартире отличный ремонт с использованием импортных стройматериалов. Обои европейских производителей, натяжные потолки, на полу ламинат. Встроенные шкафы-купе, межкомнатные двери эмаль. В ванной керамогранит испанского производства (покупался в салоне «Порту»), акриловая ванна, встроенная душевая система. Во втором санузле также испанская керамическая плитка (покупалась в «Альтагамме»). Дом расположен в одном из самых востребованных и быстроразвивающихся районов города. Удобное транспортное сообщение, рядом остановки общественного транспорта, в шаговой доступности станция метро «Грушевка» . Близость с историческим и культурным центром столицы. Многочисленные места для прогулок и отдыха. Социальная инфраструктура на доступном расстоянии: аптека, школы: №3, №105; детские сады: №85, №48, №212; спортивный комплекс с бассейном "World Class; фитнес-зал; салоны красоты; магазины "Санта", Евроопт", кафе и рестораны и другие объекты социально-бытового обслуживания, "Грушевский Сквер". Поможем профессионально быстро и выгодно продать Вашу недвижимость в связи с покупкой вышеуказанного объекта недвижимости!', 'SALE', '/sale-flats/object/3323406/');
