INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (500, 6, 18, 5477570, '2024-05-21 14:42:11.516596', '2024-05-21 14:42:11.60513', 'df3089fe-4def-4838-89de-9dd0bdc93d61', 'Целый видовой этаж в ЖК “MAESTRO” – топовом ЖК Минска, который строился специально для самых успешных людей и отвечает требованиям самого взыскательного клиента! 9 санузлов, 4 лоджии с шикарной панорамой города на все стороны света и не только! Коротко: ЖК совмещает в себе лучшие черты как многим полюбившихся «Сталинок»: - локация (самое сердце города, метро из подъезда); - шумоизоляция (проведена в каждой квартире по умолчанию); - высокие потолки (от 3 до 3.3 метра). Так и лучших новостроек города с устранением их недостатков: - очень красивый внешний вид (1 место на фестивале Белорусского союза архитекторов в номинации "Жилые многоэтажные дома"); - подземный паркинг с кладовыми; - хорошо продуманные и удобные планировки!; - панорамные окна с прекрасными видами на парк либо на проспект; - закрытый двор; - объекты сферы обслуживания в стилобате дома и пр. Рассказывать о преимуществах данного комплекса можно очень долго – их очень много. Звоните, расскажу подробнее и про ЖК, и про варианты планировок квартир, беспристрастно помогу с выбором конкретной квартиры, при необходимости организую просмотр. Бесплатно! Есть возможность покупки квартиры в кредит Также окажу помощь в получении скидок и решении любых вопросов с продажей вашей недвижимости для покупки этой!', 'SALE', '/sale-flats/object/3322819/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (43, 1, 11, 177388, '2024-05-21 13:37:14.815672', '2024-05-21 13:37:14.828641', 'b9b3cdeb-e0c4-45a9-b7f5-4541e222b7f1', 'Выгодное предложение!!! Дополнительная скидка по телефону, звоните за более подробной информацией! Бронь на месяц при продаже Вашей квартиры Стоимость актуальна на дату размещения 29.04.2024. Подробную актуальную информацию уточняйте по телефону. Варианты оплат: - наличные средства 90% сразу, 10-20 % после сдачи дома! - длительная рассрочка (очень выгодная до 3 лет)! Дом — для бизнеса и проживания! Это возможность жить, работать, прописаться и зарегистрировать свою компанию именно по этому адресу. Цены от застройщика. Все консультации и помощь в покупке новостройки БЕСПЛАТНЫЕ! Заинтересовались? Тогда звоните, подберем выгодный вариант кредитования или рассрочки также абсолютно бесплатно! Срок сдачи дома – осень 2026 год. Цена указана без учета скидки!!! Инфраструктура: · Две станции метро: «Ковальская Слобода» уже работает, «Аэродромная» строится прямо в границах комплекса · Комплекс будет удобным и для автомобилистов. Границы очерчивают две важные транспортные магистрали Минска – улицы Кижеватова и Аэродромная. По ним можно быстро добраться не только в центр города, но и в сторону МКАД. Несколько минут, и вы на месте! · Зеленая парковая зона с фонтанами, со скульптурами, аттракционами, теннисными кортами, футбольным полем и баскетбольной площадкой · международный финансовый центр и крупнейший торговый центр MARA MAII · внутри квартала - детские площадки для разных возрастов детей, цветочницы, скамейки, вело парковки · в пешей доступности будет вся собственная инфраструктура Minsk World – взрослая и детская поликлиника, медицинский центр, кафе и магазины, парковки и заправки, спортивные залы и фитнес-центры Недвижимость продаётся по цене застройщика без комиссии! Поможем продать Вашу квартиру. Подберем лучший вариант с возможностью длительной брони! Звоните прямо сейчас для более подробной консультации и расчёта всех максимальных скидок!  ООО «ЭТАЖИ юнайтед» УНП: 193673318 Договор 52/1 от 05.01.2024г. до 03.01.2025г. Лицензия на оказание риэлтерских услуг №02240/460 МЮ РБ от 03.04.2023г.', 'SALE', '/sale-flats/object/3319372/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (88, 3, 6, 545378, '2024-05-21 14:42:10.609548', '2024-05-21 14:42:10.609547', '2de65752-757d-4308-a874-a790a09ca2e3', 'ЖК «Маяк Минска» - престижный район с квартирами VIP-класса, расположенные напротив национальной Библиотеки. Элитный дом "Микеланджело" находится в ансамбле современных зданий с наклонными фасадами, огромная арка между которыми выглядит, как приглашающие входные ворота во весь комплекс "Маяк Минска". А объединяет весь ансамбль стильный двухэтажный стилобат, в котором размещены коммерческие помещения (рестораны, кафе и оздоровительный центр – все к Вашим услугам), а также собственный подземный паркинг на 50 машиномест с местами для хранения велосипедов. Доступ к машинам возможен как с улицы, так и непосредственно из жилого дома – в паркинг можно спуститься на лифте. Дом "Микеланджело" двухсекционный. Объединяет две секции общее просторное дизайнерское лобби с местом для консьержа, санитарной комнатой с пеленальным столом и зонами отдыха. У здания переменная этажность – от 9 до 13 этажей. Последние люкс квартиры - свободная планировка, высокие потолки (2,7 м) и панорамные окна. Лифты скоростные и бесшумные, фирмы OTIS Дом постройки 2019 г. Современные домофоны и системы видеонаблюдения. Хорошее развитое транспортное сообщение – рядом с главным проспектом столицы, в пешей доступности расположена станция метро "Восток". Отличная социальная инфраструктура, которая включает школу, детские сады, а также многочисленные магазины, объекты общественного питания и сервиса. Самый большой в стране торгово-развлекательный центр "Дана Молл" – райский уголок для шопинга и разнообразных развлечений.  Дополнительный сервис: + Продам Вашу квартиру для приобретения этой! + Продемонстрирую квартиры, подберу другие варианты! + Услуги ипотечного брокера. Квартира №126 в доме 5. Стоимость актуальна на дату размещения 25.04.2024. Звоните прямо сейчас для более подробной консультации!  ООО «ЭТАЖИ юнайтед» УНП: 193673318 №1253/1 от 26.02.2024 Лицензия на оказание риэлтерских услуг №02240/460 МЮ РБ от 03.04.2023.', 'SALE', '/sale-flats/object/3316959/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (62, 2, 5, 225225, '2024-05-21 14:42:11.620141', '2024-05-21 14:42:11.62014', '2259ae47-da92-4b44-a76b-07f33217a195', 'Предлагаем купить просторную 2к. квартиру в г.Бресте по ул.Бориса Маслова. Квартира расположена на 5-м этаже 10-ти этажного панельного дома 2021 года постройки. Общая площадь квартиры составляет 62 м2, жилая площадь 34,2 м2, кухня 11 м2, раздельный санузел, 1 лоджия (окна ПВХ, панорамные окна). В квартире сделан качественный ремонт: окна ПВХ, новая электрика, входные двери металлические, межкомнатные двери МДФ, на полу лежит ламинат/плитка, стены – обои. Кухонный гарнитур выполнен из современных и качественных материалов, встроенная техника. На коридоре встроенные шкафы, достаточно места для хранения. Квартира готова к проживанию. Чистый и новый подъезд. Интеллигентные соседи. Отличное расположение: рядом с домом строится школа и д/сад, рядом находятся магазины, аптеки, банк, остановки общественного транспорта и т.п. Код объекта 23116 торг Договор № 116 от 10.03.2023г.', 'SALE', '/brest-region/sale-flats/object/2987617/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (65, 3, 1, 340949, '2024-05-21 14:45:04.481494', '2024-05-21 14:45:04.497627', '66441b53-c723-4083-89e8-860d1ac1257d', 'Наличные, кредит! 1. Услуги по подбору новостроек - бесплатные!!! 2. Квартиры напрямую от застройщика, Вы покупаете по цене застройщика и заключаете договор только с застройщиком! Консультации по телефону Помощь в выборе: • новостройки • выгодные условий кредитования • юридического сопровождения Действует система скидок! Поможем продать Вашу недвижимость для покупки новостройки! Преимущества предложения: · Потрясающий вид из окна каждый день! Невероятные закаты озаряют квартиру вечером · Перед Вами открывается шикарный вид на «Парк Челюскинцев», а также дневной и вечерний Минск с его огнями, красками и заведениями на первых этажах комплекса · Станция метро «Московская» и «Парк Челюскинцев» - 10 минут спокойным шагом · Торговый-развлекательный центр «Dana Mall» – 1 станция метро · Жизнь в реалиях европейского комфорта — мечта многих! · Современный каркасно-блочный дом, повышенной комфортности 2020 г · Видеонаблюдение по периметру. · Три скоростных бесшумных лифта «Otis» · На входе консьерж и просторная гостевая зона · Высота потолков 2.72м2, 25 -этажный каркасно-блочный дом.  Квартира в жилом комплексе "Парк Челюскинцев" - жизнь в окружении природы и комфорта! Дом эксклюзивного дизайна с панорамным остеклением золотистого оттенка! Квартира свободной планировки для реализации Ваших идей и неповторимого дизайн-проекта! Панорамное остекление - много света и солнца в любое время года! В просторном лобби предусмотрено место для консьержа, зона отдыха для гостей и санитарная комната! Продам вашу недвижимость для приобретения этой. Помогу с оформление кредита и консультация по всем актуальным банкам Стоимость актуальна на дату размещения 30.04.2024 Подробную актуальную информацию уточняйте по телефону"  ООО «ЭТАЖИ юнайтед» УНП: 193673318 Договор № 1253/1 /. от 26.02.2024 Лицензия на оказание риэлтерских услуг №02240/460 МЮ РБ от 03.04.2023', 'SALE', '/sale-flats/object/3319969/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (79, 2, 4, 251324, '2024-05-21 14:45:05.298296', '2024-05-21 14:45:05.304803', '219fb03c-9060-48fd-832d-cf9e1d7c5669', '№ 230570 Приобретая данный объект, ПОКУПАТЕЛЬ не платит комиссию агентству. 2- комнатная квартира, г. Брест, Ясеневая ул., 0 г.п., 0/0 , 0/0/0/0 кв.м., с/у , Квартира в малоквартирном доме автономного типа. Окна ПВХ, пол ламинат и плиточная зона. Подогрев пола (ванна, коридор, кухня). Итальянские двери усиленного шпона с итальянской фурнитурой. Встроенная кухня со встроеннй варочной поверхностью Bosh, мойка TEKA матовой насечки. Стена украшена художественным рисунком. Зал с выходом на лоджию террасного вида, оборудованную под кофе-паузу с видом на зеленный массив.Детскакя оборудована шведской стенкой и магнитной стеной. Санузел с постаментной душевой кабиной и вентиляционным оборудованием. Унитаз-инсталляция. Шкаф-купе (коридор). Входная металлическая дверь.Благоустроенный двор,облагороженная придомовая территория с обустроенной детской площадкой, со стоянкой для автомобилей,зеленой зоной.Район с развитой инфраструктурой.Рядом с домом находятся: продовольственный магазин, аптека,школа, садик. Хорошая транспортная развязка.. Живописный вид из окон,из окон открывается живописный вид на зеленую зону.Лот 230570 Договор № 570/1 от 26.05.2023, ЗАО «Альфа-Актив», УНП 290426827, лицензия № 02240/92 от 29.12.2005 на право осуществления деятельности по оказанию юридических услуг (риэлтерские услуги) Приглашаем дружить с «Альфа-Актив»', 'SALE', '/brest-region/sale-flats/object/3048147/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (43, 1, 6, 151439, '2024-05-21 14:45:06.760898', '2024-05-21 14:45:06.773611', '492db497-9025-4e03-972e-a9820178e632', 'Пригород Минска -25 минут на маршрутке (каждые 15 минут), в 15-ти минутах ходьбы располагается железнодорожная станция «Беларусь». Вы спокойно сможете добраться до нужной части города Минска. Все необходимое находится в шаговой доступности: садики №5, №6; школа №2; Заславская гимназия; аптеки; детская поликлиника; банки; магазины и Белмаркет; рынок; Дом культуры. По улице Студенецкая 8а продается однокомнатная квартира в доме 2016г.п., на 6-ом из 10этажей. Общая площадь по СНБ- 43,1м2, жилая-17,9м2, кухня-9м2. Из кухни выход на остекленную просторную лоджию (3,1 м2), где можно оборудовать уютную зону отдыха. В квартире строительная отделка, что вам позволит реализовать все свои мечты. Встроенная кухня оборудована современной индукционной варочной панелью Gefest, доводчиками, холодильником. В коридоре располагаются: шкафа-купе, гардеробная. Раздельный сан.узел, стиральная машина Indesit. Дом находится практически на въезде в Заславль, но в глубине микрорайона. Такое удачное расположение дома обеспечит Вам тишину и чистый воздух. Придомовая территория благоустроенная, есть большая детская площадка. По обе стороны дома организованы автомобильные парковки, где Вы сможете без проблем припарковать свой автомобиль. Недалеко от дома начато строительство новой современной поликлиники. В 5 минутах от дома конечная остановка маршруток, что гарантирует Вам наличие свободных мест. Мы с радостью покажем Вам квартиру и сделаем Вас ее счастливыми хозяевами!', 'SALE', '/sale-flats/object/3261810/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (33, 1, 16, 141685, '2024-05-21 14:45:08.168832', '2024-05-21 14:45:08.180781', 'dbb36499-a831-47cd-b065-1898836ae9b8', '%%%Скидка. Рассрочка от 20%ю звоните-Все расскажу по телефону и в офисе. Выгодное предложение от застройщика. Стать владельцем апартаментов в Minsk World можно: За собственные средства (90% +10% после сдачи дома), В рассрочку (20 % первоначальный взнос) Без справок и поручителей. Нужен только П А С П О Р Т. Звоните- все расскажу. Консультация по телефону, Вайберу и в офисе.  Новый квартал Родная страна ( Т О Л Ь К О 2 дома). Бронь 30 дней - при продаже Вашей квартиры с Этажами. Бесплатная консультация, скидки и подбор по телефону (Алёна) (viber telegram)  В доме Минский замок -16 этажей будет создано всё для счастливой жизни и успешного бизнеса Срок сдачи дома – конец 2026 года. В многофункциональных апартаментах дома Мирский замок можно 1, оформить постоянную регистрацию по месту жительства, 2,зарегистрировать компанию и вести бизнес!  В новом квартале Родная страна, где будут построены всего 2 здания с многофункциональными апартаментами, сегодня стартуют продажи в Мирском замке. Застройщик предлагает всё необходимое для комфортной жизни, а также удачного начала бизнеса и его развития. Лучшие цены ждут вас именно в момент старта продаж — от 950 ев ро за м2 Этаж -1 (частично подземный). Здесь будут входные группы многофункциональных апартаментов и общественных помещений, помещения для коммерции, а также нижний уровень гаража стоянки. На 1 этаже коммерческие помещения с отдельными входами и верхний уровень гаража-стоянки. На 2-м — коммерческие и административные помещения, а также кафе для вкусных обедов и романтических вечеров с видом на сквер. Высота потолков на первых 2 этажах будет достигать 3,27 м. С 3 по 16 этаж — многофункциональные апартаменты свободной планировки. При этом на 3 этаже будут созданы апартаменты с открытыми террасами. На 5-13 этажах — с остеклёнными лоджиями и неостеклёнными балконами. На 15-16 этажах — с неостеклёнными балконами. Основные входы в многофункциональные апартаменты будут расположены на 3-16 этажах зданий. Они запроектированы в двух равноудалённых точках. У жителей будет возможность попасть в свои апартаменты через любую входную группу. Будет реализована концепция безбарьерного доступа (кры́льца со стороны улицы и прилегающей территории на уровне земли). Помимо двух многофункциональных зданий в квартале запроектированы: Рядом метро и строят башни Международного финансового центра, где будут созданы максимально комфортные и благоприятные условия для работы отечественных и зарубежных компаний. Его открытие станет новой страницей в истории экономики и триггером для роста стоимости м2 в кварталах комплекса  Бесплатная консультация, скидки и подбор по телефону (Алёна) (viber telegram) Стоимость и наличие актуальны 23,03,2024 Не мечтайте! Действуй! Звоните!', 'SALE', '/sale-flats/object/3288321/');
