INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (73, 3, 3, 285939, '2024-05-21 14:45:06.760898', '2024-05-21 14:45:06.773611', '4746e044-83bb-43b7-a4d4-913b0f0ce592', 'Наличные, рассрочка, кредит! Квартира в центре столицы в многофункциональном комплексе! 1. Услуги по подбору новостроек - бесплатные!!! 2. Квартиры напрямую от застройщика, Вы покупаете по цене застройщика и заключаете договор только с застройщиком! 3. Выполняем функцию отдела продаж застройщика Успейте купить квартиру по выгодной цене! Новый комплекс в сердце столицы! ЖК от надежного застройщика Минска в районе ст.м. "Михалово"! Монолитый дом со всеми удобствами для красивой жизни в столице! Разнообразие планировок и качество строительства гарантированы! Жилой комплекс состоит из нескольких жилых домов, а также двух паркингов.На старте продаж - два 21-этажных дома по 1 подъезду в каждом. В шаговой доступности все удобства большого города - магазины, парки, торговые центры! Удобное расположение и большой выбор на любой вкус! Планировки и цены актуальны на 12.03.2024. Подробнее по телефону', 'SALE', '/sale-flats/object/3277226/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (52, 2, 2, 176893, '2024-05-21 14:45:06.760898', '2024-05-21 14:45:06.773611', '048dc0ec-dcc1-41b1-8c98-adee32c7308a', '№ 240216 Продается комфортная двухкомнатная квартира-студия в красивом месте города Бреста, м-н Дубровка. Современный кирпичный дом 2008 года постройки расположен в тихом, закрытом дворе. Материал стен - кирпич. 2-ой этаж пятиэтажного дома. Описание квартиры: Площадь общая с лоджией - 56,2 м.кв., жилая площадь - 28,4 м.кв., кухня - 11,0 кв.м (объединена с жилой комнатой), высота потолков - 2,53 м. Квартира с качественным ремонтом, выполненном в классическом стиле из качественных материалов иностранного производителя: на полу - ламинат /плитка, дверь входная - металлическая, санузле - плитка современного образца, установлена новая сантехника, потолки- натяжные, стены - обои. Лоджия утеплена. Есть подвал. Рядом есть все для комфортного проживания. Звоните, организую просмотр квартиры в удобное для вас время. Лот 240216 Договор № 216/2 от 06.04.2024, ООО Бугриэлт, УНП 291139313, лицензия № 02240/245 от 05.02.2013 на право осуществления деятельности по оказанию юридических услуг (риэлтерские услуги) Приглашаем дружить с «Бугриэлт»', 'SALE', '/brest-region/sale-flats/object/3301128/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (38, 2, 5, 190152, '2024-05-21 14:45:08.168832', '2024-05-21 14:45:08.17663', '35403a34-29d6-4870-a618-1090ca455071', 'Квартира с планировкой "два крыла" - идеальное решение для людей с разными графиками работы, ребенком или пожилыми родителями. В квартире также удобные раздельные санузлы. Новый дом занимает выгодное расположение в квартале. Он окружен зелеными коридорами из сохраненных лесных деревьев и близко расположен к развивающейся инфраструктуре: ▪️ подъездная дорога в 2024 году ▪️ детский садик в 2025 году ▪️ торговый центр в 2027 году ▪️ школа в 2028 году Новый ситихаус 4.5 - дом комфорт-класса, выполненный из железобетонных панелей высокого качества, изготовленных на собственном заводе СБК. Закрытая территория двора без автомобилей с сохраненными лесными деревьями создает безопасное пространство и передает атмосферу настоящего леса. Автомобильная парковка вынесена за территорию двора домов 4.4 и 4.5. Территория двора будет закрыта для проезда автомобилей и разместит: ▪️ площадку для детей от 1 до 3 лет ▪️ лавочки для тихого отдыха ▪️ зона для барбекю ▪️ крытый велобокс для хранения велосипедов Парковочные места для автомобилей расположены в шаговой доступности от дома. Окончание строительства – 4 квартал 2025 Наличие и стоимость актуальны на дату размещения 15.04.2024 Более подробную информацию уточняйте по телефону. Устрою эксурссию, подберу любую другую квартиру для вас. ООО «ЭТАЖИ юнайтед» УНП: 193673318 Договор 72/1. от 03.08.2023 Лицензия на оказание риэлтерских услуг №02240/460 МЮ РБ от 03.04.2023', 'SALE', '/sale-flats/object/3309020/');
