INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (70, 3, 5, 351209, '2024-05-21 14:45:11.326896', '2024-05-21 14:45:11.34252', 'dc7dfeb2-e8e3-4e23-8156-bb75828007ce', 'Эксклюзивное предложение: просторная, трехкомнатная «Сталинка» в центре. Как бонус! На этаже имеется отдельное индивидуальное помещение с окном на 50м2. Одна квартира на лестничной площадке, что обеспечивает тишину и комфорт. Уютная, светлая. Трёхкомнатная квартира в историческом месте города. Шикарный вид из окна! Это возможность приобрести часть истории города и создать свой неповторимый дом. Идеальное место для жизни либо прекрасное вложение для инвестиций. Эта квартира - идеальный выбор для тех, кто ценит стиль, историю и комфорт. Есть возможность создать свой уникальный интерьер в квартире с историей. Тихий двор с детской площадкой и своей парковкой. В шаговой доступности от дома расположены магазины, школы, детские сады, парки и остановки общественного транспорта. Не упустите возможность приобрести эту прекрасную квартиру и сделать её своей мечтой! Звоните прямо сейчас!', 'SALE', '/sale-flats/object/3283394/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (37, 1, 18, 200047, '2024-05-21 14:45:17.454616', '2024-05-21 14:45:17.458687', 'df104723-3969-481b-b76e-cb72772730ac', 'Квартира напрямую от застройщика Без комиссий и переплат! Консультация, подбор и сопровождение абсолютно БЕСПЛАТНО!  Поможем с продажей Вашей недвижимости для покупки этой! Варианты оплат: Наличные средства; Кредит (звоните, и наш кредитный брокер рассчитает наиболее выгодный вариант именно для Вас); Рассрочка (без поручителей); Лизинг (для физ. лиц). Стоимость и наличие указаны на 03.04.2024. Звоните, чтобы уточнить актуальность! Дом 7.36 располагается рядом с Центральным парком с детскими и спортивными площадками. Через дорогу будет уже построенная школа «Арт-парк» и еще одна школа, в перспективе. С другой стороны от группы домов находится Авиационная улица с самой разнообразной коммерческой инфраструктурой, кафе, центрами для развития талантов и проведения досуга. В подъезде: • Помещение для мытья лап домашних животных • Колясочная на каждом этаже • Видеодомофоны • Удобная навигация • Чат-доска • Полки для book crossing • Почтовые ящики со спам-отделением • Безбарьерный вход Центр двора состоит из детских площадок, площади с елью, барбекю зоны и спортивной зоны. Территории четко и функционально разграничены полигональными насыпями, но продуманы так, что взрослые могут собраться на барбекю и одновременно смотреть за детьми или участвовать в дворовом мероприятии. На площадке размещаются домики в стиле «горной деревни» и стилизованные качели в виде овечек, которые не оставят равнодушными ни детей, ни взрослых. На одной из детских площадок размещен уникальный игровой комплекс - огромный вулкан. 3-4к квартиры продаются с машино-местом в Паркинге НБ №5 в ком. зоне. ООО «ЭТАЖИ юнайтед» УНП: 193673318 №71/1 от 03.08.2023 Лицензия на оказание риэлтерских услуг №02240/460 МЮ РБ от 03.04.2023', 'SALE', '/sale-flats/object/3298199/');
