INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (70, 3, 7, 144672, '2024-05-21 14:45:48.734528', '2024-05-21 14:46:25.78496', '1b2749ca-430b-4d25-94da-438bb66e1394', 'Уютная, светлая, теплая, просторная, не угловая и это все про ВАШУ будущую квартиру. Продается 3 - комнатная квартира г.Борисов, ул. 1 Июля, д.31 Панельный дом, 1991 года постройки. Квартира расположена на комфортном 7 этаже из 9. А подниматься вы будете к ней на новом лифте. Общая площадь по СНБ - 70.3 кв.м. 3 изолированные комнаты: 12.3 с выходом на застекленную лоджию, 12.3 кв.м. и 17.1 кв.м. Просторная кухня - 9.4 кв.м. Окна выходят на 2 стороны дома (на улицу - восток, со двора - запад). Что позволяет наблюдать красивые закаты. Сделан хороший ремонт. Во всей квартире установлены стеклопакеты, в том числе на лоджии. Напольное покрытие - линолеум и плитка. Металлическая входная дверь. Проведен интернет. Квартира в жилом состоянии, что позволит заехать и постепенно делать ремонт на свой вкус. Хорошее месторасположение: Возле дома в шаговой доступности открылся крупный строительный магазин Билд; В шаговой доступности 2-я поликлиника; В шаговой доступности спортивный комплекс в котором сауна, бассейн тренажерный зал и т.д.; В шаговой доступности ДНК в котором проходят культурно массовые мероприятия ( приезжие театры, концерты и т.д.); В шаговой доступности детская спортивная школа где могут ваши дети тренироваться дзюдо, легкой атлетикой, художественной гимнастикой, танцами; Множество в шаговой доступности кофеен, ресторанов, пиццерий; В шаговой доступности универмаг, Дом торговли и множество магазинов, банков; В шаговой доступности загс, исполком, горисполком, БРТИ и другие инстанции. ООО “Столичный регион”, УНП 193369678. Лицензия МЮ РБ № 02240/404 от 24 декабря 2020 г., Договор на оказание риэлтерских услуг №65/3 от 06.12.2023 г.', 'SALE', '/sale-flats/object/3229545/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (53, 2, 2, 119218, '2024-05-21 14:46:41.121531', '2024-05-21 14:46:55.163151', 'd5f7ab0a-7308-48e1-bde3-f7f6d876790a', 'Продается отличная 2-комнатная квартира , расположенная на ул.Курчатова 44. Панельный дом 1991 года, идеальный 2 этаж .Прекрасное местоположение дома. Уютный двор, аккуратный чистый подьезд, спокойные соседи сделают ваше проживание комфортным. Развитая инфраструктура дома (магазины, евроопт, школы, детские сады ,поликлиника ) , транспортная развязка существенно сэкономят время прибывания в пути . Рядом с домом удобная парковка , есть хорошая детская площадка . Параметры квартиры: общая площадь- 52,9 кв м жилая площадь- 29,8 кв м, кухня-8,7 кв м. Материал полов: плитка и ламинат. Санузел раздельный. Имеется застекленный балкон ,есть 2 подвала. Квартира продается частично с мебелью ,возможен торг. Идеально подойдет всем, кто ценит хорошее расположение дома и удобную планировку. Более подробно- по телефону. Звоните! А лучше- приезжайте! Оперативный показ и юридическое сопровождение сделки гарантируем.', 'SALE', '/grodno-region/sale-flats/object/2934874/');
INSERT INTO flat.flat (area, bedrooms, floor, price, dt_create, dt_update, uuid, description, offer_type, original_url) VALUES (45, 1, 13, 222325, '2024-05-21 14:47:13.401706', '2024-05-21 14:47:23.220351', '7680c3b2-978e-4e2d-9efd-52e2a176c65d', 'Продаётся однокомнатная квартира ул. Основателей 7 Площадь по СНБ – 45 м2/ общая – 42.5 м2/ жилая – 18 м2/ кухня – 9.2 м2 ТОП-причин купить именно эту квартиру: 1. Дом находится в лесопарковой зоне; 2. Дом находится на огороженной шлагбаумом территории; 3. Мебель и техника остаются в квартире – заезжай и живи без дополнительных затрат; 4. Дом построен в 2016 году; 5. Ухоженный и чистый подъезд; Развитая устоявшаяся инфраструктура: - в шаговой доступности всё необходимое для жизни: Dana Mall в 10 минутах езды, продуктовые магазины, аптеки, новая школа и детские сады, отделения банков, множество кафе и салоны красоты и множество других объектов сферы услуг; Удобное транспортное сообщение: - в двух шагах от дома остановки общественного транспорта (автобусы и маршрутные такси); - всего 5 минут езды станция метро Уручье. Звоните сегодня, потому что завтра Вы можете услышать, что она продана! Помогу Вам продать Вашу квартиру для приобретения этой Этот объект можно купить в кредит, подробности уточняйте у специалиста по недвижимости.', 'SALE', '/sale-flats/object/3323376/');
